namespace NS.Shared.Enums
{
    public enum Country
    {
        [CustomCountry(Name = "Afghanistan", FullName = "Islamic Republic of Afghanistan", Capital = "Kabul", Description = "Afghanistan is a landlocked country at the crossroads of Central and South Asia. The country shares borders with Uzbekistan, Turkmenistan, Tajikistan, Iran, Pakistan, China, and the disputed Kashmir territory", Region = "Asia", Subregion = "Southern Asia")]
        AF = 1,

        [CustomCountry(Name = "Åland Islands", FullName = "Åland Islands", Capital = "Mariehamn", Description = "The Åland Islands in the Baltic Sea have extensive maritime history, warm, sunny weather, and popular outdoor activities. Although the islands are a part of Finland, they are a self-governing, autonomous territory. The 30,000 islanders (2021) mostly speak a local dialect of Swedish.", Region = "Europe", Subregion = "Northern Europe")]
        AX = 2,

        [CustomCountry(Name = "Albania", FullName = "Republic of Albania", Capital = "Tirana", Description = "Albania is a country in the Balkan region of Europe with unspoiled beaches, mountainous landscapes, traditional cuisine, archaeological artefacts, unique traditions, low prices and the wild atmosphere of the countryside. It is one of the sunniest countries in Europe. The country has an extensive archaeological heritage; it was part of Ancient Greece, the Roman Empire and the Ottoman Empire until its first declaration of independence in 1912, becoming a kingdom and then a communist dictatorship before becoming a democratic republic. Albania is one of just a few Muslim majority nations in Europe.", Region = "Europe", Subregion = "Southern Europe")]
        AL = 3,

        [CustomCountry(Name = "Algeria", FullName = "People's Democratic Republic of Algeria", Capital = "Algiers", Description = "Algeria is the largest country in Africa. Overlooked by many travelers, the country is bursting with beauty waiting to be discovered. From the bustling markets of Algiers to the pristine beaches of its Mediterranean coast, from the jaw-droppingly beautiful mountains of the north to the mesmerizing deep reaches of the Sahara desert to the south, there is something for almost everyone to explore. Enjoy traditional cuisine, explore the ancient ruins, take in the breathtaking views, and then breathe in a world where few travelers tread. Algeria, and in particular Algerian hospitality, will leave a lasting impression on your heart and mind.", Region = "Africa", Subregion = "Northern Africa")]
        DZ = 4,

        [CustomCountry(Name = "American Samoa", FullName = "American Samoa", Capital = "Pago Pago", Description = "American Samoa is a U.S. territory in the South Pacific Ocean that lies about 100 km (60 mi) east of its neighboring country of Samoa, which is part of the same archipelago. American Samoa consists of five main islands and two coral atolls; the largest and most populous island is Tutuila, with the Manuʻa Islands, Rose Atoll and Swains Island also included in the territory.", Region = "Oceania", Subregion = "Polynesia")]
        AS = 5,

        [CustomCountry(Name = "Andorra", FullName = "Principality of Andorra", Capital = "Andorra la Vella", Description = "Andorra is a small, mountainous country in Western Europe, up in the Pyrenees between France and Spain. Full of beautiful mountains and charming old villages, the country thrives on tourism, mainly visitors from nearby countries who come for shopping, skiing, hiking, and banking.", Region = "Europe", Subregion = "Southern Europe")]
        AD = 6,

        [CustomCountry(Name = "Angola", FullName = "Republic of Angola", Capital = "Luanda", Description = "Angola is a beautiful nation in Central Africa endowed with lovely waterfalls, rivers, national parks, and coastlines. There is plenty to do and see here.", Region = "Africa", Subregion = "Middle Africa")]
        AO = 7,

        [CustomCountry(Name = "Anguilla", FullName = "Anguilla", Capital = "The Valley", Description = "Anguilla is a British Overseas Territory in the Caribbean Sea, a few miles north of Saint Martin. Anguilla has everything you might expect from a Caribbean island, with gorgeous bays, some of the best white sand beaches in the world, palm trees and the turquoise ocean all around. That lovely setting is of course what draws most travelers here, and it allows for perfect lazy days of sunbathing and swimming.", Region = "Americas", Subregion = "Caribbean")]
        AI = 8,

        [CustomCountry(Name = "Antarctica", FullName = "Antarctica", Capital = "", Description = "Antarctica is the coldest and driest place on Earth, and surrounds the South Pole. Tourist visits are costly, demand physical fitness, can only take place in summer, and are largely limited to the Peninsula, Islands and Ross Sea. A couple of thousand staff live here in summer in some four dozen bases mostly in those areas; a small number stay over winter. Inland Antarctica is a desolate plateau covered by 2–3 kilometres (1.2–1.9 mi) of ice. Occasional specialist air tours go inland, for mountaineering or to reach the Pole, which has a large base. Wildlife needs access to the sea and is confined to the coasts.", Region = "Antarctic", Subregion = null)]
        AQ = 9,

        [CustomCountry(Name = "Antigua and Barbuda", FullName = "Antigua and Barbuda", Capital = "St. John's", Description = "Antigua and Barbuda are two Caribbean islands that form a country that lies between the Caribbean Sea and the North Atlantic Ocean, east-southeast of Puerto Rico.", Region = "Americas", Subregion = "Caribbean")]
        AG = 10,

        [CustomCountry(Name = "Argentina", FullName = "Argentine Republic", Capital = "Buenos Aires", Description = "Argentina is a large country in the southern part of South America. It offers a great diversity of climates and landscapes from jungles in the north, great grass plains in the center and frozen mountains in the south.", Region = "Americas", Subregion = "South America")]
        AR = 11,

        [CustomCountry(Name = "Armenia", FullName = "Republic of Armenia", Capital = "Yerevan", Description = "Armenia is a landlocked country in the Caucasus. Once the center of an empire, this former Soviet republic straddles the line between Europe and Asia. Armenia has a rich, ancient history, and it is most famously known for being the first country in the world to adopt Christianity as the state religion.", Region = "Asia", Subregion = "Western Asia")]
        AM = 12,

        [CustomCountry(Name = "Aruba", FullName = "Aruba", Capital = "Oranjestad", Description = "Aruba is a desert Caribbean island, a constituent country of the Kingdom of the Netherlands. Located off the coast of Venezuela, this flat, river-less island is renowned for its white sand beaches. Along with its neighboring Dutch islands of Bonaire and Curaçao, it forms the ABC Islands.", Region = "Americas", Subregion = "Caribbean")]
        AW = 13,

        [CustomCountry(Name = "Australia", FullName = "Commonwealth of Australia", Capital = "Canberra", Description = "There is nowhere else quite like Australia, nicknamed the Land Down Under, the only country that has a whole continent to itself. With Indigenous cultures that go back over 65,000 years and truly global immigration in modern times, the country is famous for its natural wonders, wide open spaces, beaches, deserts, \"the bush\", and \"the Outback\". However, it is also highly urbanized, with an array of cosmopolitan cities – the largest and most famous being Sydney, situated on one of the most famous harbors in the world.", Region = "Oceania", Subregion = "Australia and New Zealand")]
        AU = 14,

        [CustomCountry(Name = "Austria", FullName = "Republic of Austria", Capital = "Vienna", Description = "Austria is a landlocked German-speaking country in Central Europe. Austria, along with neighboring Switzerland, is the winter sports center of Europe. However, it is just as popular for summer tourists who visit its historic cities and villages and hike in the magnificent scenery of the Alps. With more than 30 million arrivals (2023) and only about nine million inhabitants, it is one of the most visited countries in the world.", Region = "Europe", Subregion = "Western Europe")]
        AT = 15,

        [CustomCountry(Name = "Azerbaijan", FullName = "Republic of Azerbaijan", Capital = "Baku", Description = "Azerbaijan is a former Soviet republic in the Caucasus and is variously considered part of Europe or Asia.", Region = "Asia", Subregion = "Western Asia")]
        AZ = 16,

        [CustomCountry(Name = "Bahamas", FullName = "Commonwealth of the Bahamas", Capital = "Nassau", Description = "The Bahamas, or The Bahama Islands, is an archipelago consisting of many islands in the Atlantic Ocean east of Florida. The country is made up of about 2,000 islands if you include the cays, which are small islands that are formed on coral reefs. Not densely populated, the Bahamas is renowned for its natural beauty, unique culture, and is a popular tropical vacation destination.", Region = "Americas", Subregion = "Caribbean")]
        BS = 17,

        [CustomCountry(Name = "Bahrain", FullName = "Kingdom of Bahrain", Capital = "Manama", Description = "The Kingdom of Bahrain is a Middle Eastern archipelago in the Persian Gulf, tucked into a pocket of the sea flanked by Saudi Arabia and Qatar. The kingdom combines modern Arab culture and the archaeological legacy of 5,000 years of civilization.", Region = "Asia", Subregion = "Western Asia")]
        BH = 18,

        [CustomCountry(Name = "Bangladesh", FullName = "People's Republic of Bangladesh", Capital = "Dhaka", Description = "The People's Republic of Bangladesh is a country in South Asia, on the edge of the Indian subcontinent. The country is endowed with pristine beaches, numerous archaeological sites, bustling markets, numerous sites of religious importance, forests, delicious food, and more importantly, hospitable and friendly people.", Region = "Asia", Subregion = "Southern Asia")]
        BD = 19,

        [CustomCountry(Name = "Barbados", FullName = "Barbados", Capital = "Bridgetown", Description = "Barbados is an island in the Caribbean region, but which lies out in the Atlantic many miles east of the Caribbean Sea. Its nearest neighbors 100 miles west are Saint Vincent and Saint Lucia, part of the arc of the Lesser Antilles that separate Atlantic and Caribbean. Those islands are a partly-submerged chain of mountains. By contrast Barbados has formed from deposits of coral and has a gentler landscape. It's fertile, and is sometimes called \"Bimshire\" or the \"Little Britain\" of the Caribbean because of its long and uniquely unbroken history of British colonization and settlement. It became independent in 1966 and tourism is nowadays its main industry. In 2019 the population was 287,025.", Region = "Americas", Subregion = "Caribbean")]
        BB = 20,

        [CustomCountry(Name = "Belarus", FullName = "Republic of Belarus", Capital = "Minsk", Description = "Belarus is a former Soviet state whose history begins in the 10th century CE. While not on most tourists' radar, Belarus preserves beautiful castles, pristine nature, and Soviet heritage. It maintains close ties and an open border with its neighbor Russia. The name of the country literally means \"White Russia\" in the Russian language.", Region = "Europe", Subregion = "Eastern Europe")]
        BY = 21,

        [CustomCountry(Name = "Belgium", FullName = "Kingdom of Belgium", Capital = "Brussels", Description = "A low-lying country in the Benelux, Belgium sits at the crossroads of Western Europe. It marries the historical landmarks for which the continent is famous with spectacular modern architecture and rural idylls. Its capital, Brussels, is home to the headquarters of the European Union.", Region = "Europe", Subregion = "Western Europe")]
        BE = 22,

        [CustomCountry(Name = "Belize", FullName = "Belize", Capital = "Belmopan", Description = "Belize offers world-class attractions include exploring the lush jungles with exotic plants and animals, deep sea fishing, swimming, snorkeling and diving in the Caribbean Sea with its attractive reefs and visiting the Mayan ruins. While income levels are still very low and the infrastructure is very basic, Belizeans are very proud and friendly to visitors as the tourist industry grew greatly in the last decade. It is the only country in mainland Central America with English as its official language.", Region = "Americas", Subregion = "Central America")]
        BZ = 23,

        [CustomCountry(Name = "Benin", FullName = "Republic of Benin", Capital = "Porto-Novo", Description = "Benin is a country in West Africa. You'll find culture through a large collection of palatial ruins and temples of the once powerful Kingdom of Dahomey (1800s–1894). Moreover, Benin is the birthplace of Vodun (Voodoo) and all that goes with it — Vodun is the official religion of the country, and an important part of the life of ordinary Beninese. Many important tourist sites are linked to Vodun or the slave trade. The national parks of Benin are well worth a visit for their wildlife. It is also, fortunately, one of the most stable and safe countries of the region for travelling. With its rich history, vibrant culture, protected wildlife, Grand Popo ocean beach, and artisan market in Se, Benin is one of the best kept tourist secrets in West Africa.", Region = "Africa", Subregion = "Western Africa")]
        BJ = 24,

        [CustomCountry(Name = "Bermuda", FullName = "Bermuda", Capital = "Hamilton", Description = "Bermuda is a self-governing British overseas territory in the Atlantic Ocean north of the Caribbean, off the coast of North America. It is one of the last remnants of the British colonial empire in North America. Although it is not in the Caribbean, it shares a lot of cultural similarities with much of the English-speaking Caribbean and so is treated as such here.", Region = "Americas", Subregion = "North America")]
        BM = 25,

        [CustomCountry(Name = "Bhutan", FullName = "Kingdom of Bhutan", Capital = "Thimphu", Description = "The Kingdom of Bhutan is a small country in the Himalayas between Tibet and India. Besides the stunning natural scenery, the enduring image of the country for most visitors is the strong sense of culture and tradition that binds the kingdom and clearly distinguishes it from its larger neighbors. Bhutan is a bastion of Vajrayana Buddhism, and the profound teachings of this tradition remain well preserved and exert a strong influence in all aspects of life.", Region = "Asia", Subregion = "Southern Asia")]
        BT = 26,

        [CustomCountry(Name = "Bolivia", FullName = "Plurinational State of Bolivia", Capital = "Sucre", Description = "Bolivia is a beautiful, geographically rich, and multiethnic country in the heart of South America, visited for its stunning mountain landscapes and vibrant indigenous culture.", Region = "Americas", Subregion = "South America")]
        BO = 27,

        [CustomCountry(Name = "Caribbean Netherlands", FullName = "Bonaire, Sint Eustatius and Saba", Capital = "", Description = "Caribbean Netherlands refers to three Caribbean islands that are overseas municipalities of the European country of the Netherlands: Bonaire, famous for its dive spots; Sint Eustatius, famous for its tranquility; Saba, known for its unique ecosystem;", Region = "Americas", Subregion = "Caribbean")]
        BQ = 28,

        [CustomCountry(Name = "Bosnia and Herzegovina", FullName = "Bosnia and Herzegovina", Capital = "Sarajevo", Description = "Bosnia and Herzegovina is a European country on the Balkan Peninsula. Mostly mountainous, it has access to a tiny portion of the Adriatic Sea coastline in the south. Visitors find well-restored historic cities, a warm and welcoming atmosphere, bustling city life and medieval monuments.", Region = "Europe", Subregion = "Southern Europe")]
        BA = 29,

        [CustomCountry(Name = "Botswana", FullName = "Republic of Botswana", Capital = "Gaborone", Description = "Botswana is a landlocked country in Southern Africa, completely surrounded by four countries: Namibia, South Africa, Zambia, and Zimbabwe. Botswana is a true gem among African nations, boasting a remarkable level of wealth and tranquility that few other countries on the continent can match. With its high standard of living and extremely low crime rates, Botswana has established itself as an oasis of stability amidst the many challenges faced by its neighbors. But Botswana is much more than just a peaceful haven. This captivating country is also home to a wealth of attractions that are sure to delight any traveler. From the stunning Tsodilo Hills and Chobe National Park to the Moremi Game Reserve in the Okavango Delta and the Central Kalahari Game Reserve, there is no shortage of natural wonders to explore.", Region = "Africa", Subregion = "Southern Africa")]
        BW = 30,

        [CustomCountry(Name = "Bouvet Island", FullName = "Bouvet Island", Capital = "", Description = "Bouvet Island or Bouvetøya is one of the sub-Antarctic islands, an uninhabited ice-clad place 2,600 km south-southwest of Cape Town. It has a good claim to be the world's most remote island: anywhere within 2,000 km is similarly desolate, such as mainland Antarctica. It lies 6,040 km south of the equator and is a dependency of Norway; for comparison Oslo main railway station is 6650 km north of the equator and can be cold but never ice-clad. That's testament to the chill of the Southern Ocean surrounding Antarctica, compared to the balmy North Atlantic.", Region = "Antarctic", Subregion = null)]
        BV = 31,

        [CustomCountry(Name = "Brazil", FullName = "Federative Republic of Brazil", Capital = "Brasília", Description = "Brazil is the largest country in South America and the fifth largest in the world. Brazil is an incredibly diverse country, in people, culture, and landscapes—from the famous summer carnival in Rio de Janeiro, Salvador, Olinda, and Recife to the wild power of nature in the Amazon and Iguaçu Falls. You'll find bustling cities, laid-back beaches, and traditional lifestyles, often right next to each other. Brazilian culture, which varies substantially across the country, comes from an international mix of European colonizers, African and Asian communities, and indigenous influence throughout the country.", Region = "Americas", Subregion = "South America")]
        BR = 32,

        [CustomCountry(Name = "British Indian Ocean Territory", FullName = "British Indian Ocean Territory", Capital = "Diego Garcia", Description = "The British Indian Ocean Territory, also known as the Chagos Islands, is centrally located in the Indian Ocean, south of the Maldives, about halfway between Madagascar and Indonesia. The main island, Diego Garcia, is a military facility off limits to anyone not on official duty, but some of the uninhabited outer islands can be visited by independent yachters with advance permission.", Region = "Africa", Subregion = "Eastern Africa")]
        IO = 33,

        [CustomCountry(Name = "Brunei", FullName = "Brunei Darussalam", Capital = "Bandar Seri Begawan", Description = "The Sultanate of Brunei is a small but — thanks to natural gas and petroleum resources — very rich country on the island of Borneo in Southeast Asia.", Region = "Asia", Subregion = "South-Eastern Asia")]
        BN = 34,

        [CustomCountry(Name = "Bulgaria", FullName = "Republic of Bulgaria", Capital = "Sofia", Description = "Bulgaria, officially known as the Republic of Bulgaria, is a country in the Balkan region of Europe, west of the Black Sea and south of the Danube river.", Region = "Europe", Subregion = "Eastern Europe")]
        BG = 35,

        [CustomCountry(Name = "Burkina Faso", FullName = "Burkina Faso", Capital = "Ouagadougou", Description = "Burkina Faso is a landlocked country in West Africa. Burkina Faso is one of the friendliest countries in all of Africa. Until unrest began in the late 2010s that made travel to the country unsafe, it received only a few tourists per year, and was an excellent destination for anyone interested in seeing a beautiful West African country and exploring African culture and music. It offers a diverse traditional culture, history, tribal art and a variety of landscapes.", Region = "Africa", Subregion = "Western Africa")]
        BF = 36,

        [CustomCountry(Name = "Burundi", FullName = "Republic of Burundi", Capital = "Gitega", Description = "Burundi is a small country in East Africa, although it has some cultural and geographical ties with Central Africa. It is surrounded by Rwanda, Tanzania and the Democratic Republic of the Congo. Although the country is rich in culture and history, the country has been in a state of instability since gaining independence in the 1960s. Burundi is one of the world's poorest and least developed countries and has a myriad of social, political, and economic problems.", Region = "Africa", Subregion = "Eastern Africa")]
        BI = 37,

        [CustomCountry(Name = "Cabo Verde", FullName = "Republic of Cabo Verde", Capital = "Praia", Description = "Cape Verde or CV is a country off the coast of West Africa. It is in a cluster of islands of the Atlantic Ocean, 570 km off the western coast of Senegal.", Region = "Africa", Subregion = "Western Africa")]
        CV = 38,

        [CustomCountry(Name = "Cambodia", FullName = "Kingdom of Cambodia", Capital = "Phnom Penh", Description = "The Kingdom of Cambodia is in Southeast Asia. While the Angkor Wat commemorates Cambodia's glorious history, the country has been ravaged by colonialism, the Indochina Wars, and the Khmer Rouge regime, and remains one of Asia's poorest countries. However, in the 21st century, the country is getting back on its feet, and is today one of Asia's most popular tourist destinations.", Region = "Asia", Subregion = "South-Eastern Asia")]
        KH = 39,

        [CustomCountry(Name = "Cameroon", FullName = "Republic of Cameroon", Capital = "Yaoundé", Description = "Cameroon is a country in Central Africa. Known as \"Africa in miniature\", the country is known for its geological, linguistic, artistic, and cultural diversity: some 250 languages are spoken in this mid-sized country. Cameroon was colonised by three European countries — Germany, France, and the United Kingdom.", Region = "Africa", Subregion = "Middle Africa")]
        CM = 40,

        [CustomCountry(Name = "Canada", FullName = "Canada", Capital = "Ottawa", Description = "Canada is the world's second largest country by area, behind only Russia. Nicknamed the Great White North, Canada is renowned for its vast landscapes of outstanding natural beauty and its multicultural heritage. While there are cosmopolitan cities, much of Canada consists of forests, it has more lakes than any other country and it features the Rocky Mountains, the Prairies, three oceanic coasts and a sparsely populated archipelago extending into the Arctic.", Region = "Americas", Subregion = "North America")]
        CA = 41,

        [CustomCountry(Name = "Cayman Islands", FullName = "Cayman Islands", Capital = "George Town", Description = "The Cayman Islands are an island group in the Caribbean Sea, 90 mi (140 km) south of Cuba. They are a self-governing British Overseas Territory. The stunning coral reefs and outstandingly clear waters have made this island group a popular destination for divers. Great beaches and fine restaurants and resorts make it an excellent tourist destination as well.", Region = "Americas", Subregion = "Caribbean")]
        KY = 42,

        [CustomCountry(Name = "Central African Republic", FullName = "Central African Republic", Capital = "Bangui", Description = "The Central African Republic, also known by the acronym CAR, is located in the heart of Africa. The former French colony has borders with six countries and has had a very troubled history since the 1960s.", Region = "Africa", Subregion = "Middle Africa")]
        CF = 43,

        [CustomCountry(Name = "Chad", FullName = "Republic of Chad", Capital = "N'Djamena", Description = "Chad is a landlocked country situated in the center of Africa. Chad is home to more than 200 different ethnic groups and there are national parks, desert lakes, sand dunes, canyons and camel caravans that will interest the daring and adventurous.", Region = "Africa", Subregion = "Middle Africa")]
        TD = 44,

        [CustomCountry(Name = "Chile", FullName = "Republic of Chile", Capital = "Santiago", Description = "Chile is a country in South America. Chile occupies a long, narrow strip of land between the Andes and the Pacific Ocean.", Region = "Americas", Subregion = "South America")]
        CL = 45,

        [CustomCountry(Name = "China", FullName = "People's Republic of China", Capital = "Beijing", Description = "China is one of the world's oldest civilizations. Its long and rich history is present in people's thinking and values, and in the art, architecture, and feats of engineering that remain from dynasties past. In addition to its bustling and futuristic cities like Shanghai and Shenzhen, China boasts an incredible array of breathtaking natural wonders like the karst landscapes of Guilin and granite peaks of Huangshan that have inspired painters and poets for generations.", Region = "Asia", Subregion = "Eastern Asia")]
        CN = 46,

        [CustomCountry(Name = "Christmas Island", FullName = "Christmas Island", Capital = "Flying Fish Cove", Description = "Christmas Island is one of the islands of the Indian Ocean in Southeast Asia. It is south of Indonesia and some 1,550 km northwest of Australia, of which it is a territory. It was home to about 1,800 people in 2016, a mix of Straits Chinese, Malay, Australian and other ethnic groups.", Region = "Oceania", Subregion = "Australia and New Zealand")]
        CX = 47,

        [CustomCountry(Name = "Cocos (Keeling) Islands", FullName = "Territory of Cocos (Keeling) Islands", Capital = "West Island", Description = "The Cocos (Keeling) Islands or simply Cocos Islands or Keeling Islands are a chain of islands in two adjacent atolls, in the middle of the Indian Ocean some 2,750 km northwest of Perth, and around 900 km west-southwest of Christmas Island. The islands are generally considered to be the southernmost point of Asia.", Region = "Oceania", Subregion = "Australia and New Zealand")]
        CC = 48,

        [CustomCountry(Name = "Colombia", FullName = "Republic of Colombia", Capital = "Bogotá", Description = "Colombia occupies the northwest corner of South America. It has an area twice that of France, with long coasts on the Caribbean and the Pacific Oceans, mountainous regions, and Amazon jungle areas inland. The ethnic groups and cultures are diverse.", Region = "Americas", Subregion = "South America")]
        CO = 49,

        [CustomCountry(Name = "Comoros", FullName = "Union of the Comoros", Capital = "Moroni", Description = "The Comoros is an island nation off the coast of East Africa, in the Indian Ocean between northern Mozambique and northern Madagascar.", Region = "Africa", Subregion = "Eastern Africa")]
        KM = 50,

        [CustomCountry(Name = "DR Congo", FullName = "Democratic Republic of the Congo", Capital = "Kinshasa", Description = "The Democratic Republic of the Congo is the largest and most populous country in Central Africa, as well as the world's largest Francophone country.", Region = "Africa", Subregion = "Middle Africa")]
        CD = 51,

        [CustomCountry(Name = "Congo", FullName = "Republic of the Congo", Capital = "Brazzaville", Description = "The Republic of the Congo is a country in Central Africa. It is commonly referred to as Congo-Brazzaville to distinguish itself from its giant neighbor, the Democratic Republic of the Congo (Congo-Kinshasa).", Region = "Africa", Subregion = "Middle Africa")]
        CG = 52,

        [CustomCountry(Name = "Cook Islands", FullName = "Cook Islands", Capital = "Avarua", Description = "The Cook Islands is an island country in free association with New Zealand, located in Polynesia, in the middle of the South Pacific Ocean. It is an archipelago of 15 islands spread over 2.2 million km2 of ocean.", Region = "Oceania", Subregion = "Polynesia")]
        CK = 53,

        [CustomCountry(Name = "Costa Rica", FullName = "Republic of Costa Rica", Capital = "San José", Description = "Costa Rica has bewilderingly diverse culture, climates, flora, and fauna, and landscapes range from rainforests, to dry tropical and temperate forests, to volcanoes, to Caribbean and Pacific beaches, to high mountains, and marshy lowlands. Costa Rica is an exceptionally stable and peaceful country compared to the volatile region it's in, and is one of the world's top destinations for nature and ecotourism. Owing in part to its comparative wealth, it can be a bit more expensive than its northern neighbors in Central America.", Region = "Americas", Subregion = "Central America")]
        CR = 54,

        [CustomCountry(Name = "Côte d'Ivoire", FullName = "Republic of Côte d'Ivoire", Capital = "Abidjan", Description = "Côte d'Ivoire is a country in West Africa, visited for its beaches, rainforest, wildlife and tourist villages. Resort lodgings in coastal areas draw many visitors.", Region = "Africa", Subregion = "Western Africa")]
        CI = 55,

        [CustomCountry(Name = "Croatia", FullName = "Republic of Croatia", Capital = "Zagreb", Description = "Croatia is a Mediterranean country in Southeastern Europe, and is a part of the Balkans. Much of the tourist industry is concentrated along the coast. Nautical tourism is supported by marinas, while cultural tourism relies on the appeal of medieval coastal cities and cultural events taking place during the summer. Inland areas offer agrotourism, mountain resorts, and spas. Zagreb is a significant destination, rivalling major coastal cities and resorts. Croatia has unpolluted marine areas with nature reserves and 116 Blue Flag beaches. Croatia was ranked first in Europe for swimming water quality in 2022 by the European Environmental Agency.", Region = "Europe", Subregion = "Southern Europe")]
        HR = 56,

        [CustomCountry(Name = "Cuba", FullName = "Republic of Cuba", Capital = "Havana", Description = "Cuba is the largest Caribbean island. The country has nine World Heritage Sites, as well as beaches, colonial architecture and distinct cultural history. It has had a communist government since the Cuban Revolution in 1959 and has been under a US embargo ever since.", Region = "Americas", Subregion = "Caribbean")]
        CU = 57,

        [CustomCountry(Name = "Curaçao", FullName = "Country of Curaçao", Capital = "Willemstad", Description = "Curaçao is an island in the Caribbean Sea, among the group known as the ABC Islands alongside Aruba and Bonaire. This trio is located near Venezuela, and is considered to be outside the Caribbean's so-called \"hurricane zone\"; vacations to the island are rarely disrupted by tropical storms.", Region = "Americas", Subregion = "Caribbean")]
        CW = 58,

        [CustomCountry(Name = "Cyprus", FullName = "Republic of Cyprus", Capital = "Nicosia", Description = "Cyprus is an island in the eastern Mediterranean Sea, south of Turkey. It is one of the world’s oldest civilizations, with a history of over 11,000 years. Cyprus offers lots of archaeological sites, hiking trails through cedar forests, kilometers and kilometers of gorgeous beaches, and 300 days of sun a year.", Region = "Europe", Subregion = "Southern Europe")]
        CY = 59,

        [CustomCountry(Name = "Czechia", FullName = "Czech Republic", Capital = "Prague", Description = "The Czech Republic, or Czechia (Česko) is a landlocked country in Central Europe. It is not a large country but has a rich and eventful history, including incidents and people like King Wenceslas, Jan Huss, the Thirty-years War, Operation Anthropoid and the dissolution of Czechoslovakia. Czechs, Germans, Slovaks, Italian stonemasons and stucco workers, French tradesmen and deserters from Napoleon's army have lived and worked here, all influencing one another. For centuries they jointly cultivated their land, creating works that grace this small country with hundreds of ancient castles, monasteries and stately mansions, and entire towns that give the impression of being comprehensive artefacts. The Czech Republic contains a vast number of architectural treasures and has beautiful forests and mountains to match.", Region = "Europe", Subregion = "Eastern Europe")]
        CZ = 60,

        [CustomCountry(Name = "Denmark", FullName = "Kingdom of Denmark", Capital = "Copenhagen", Description = "Denmark is the smallest of the Nordic countries in terms of landmass. Once the seat of Viking raiders and later a major north European naval power, the Kingdom of Denmark is the oldest kingdom in the world still in existence, but has evolved into a democratic, modern, and prosperous nation.", Region = "Europe", Subregion = "Northern Europe")]
        DK = 61,

        [CustomCountry(Name = "Djibouti", FullName = "Republic of Djibouti", Capital = "Djibouti", Description = "Djibouti is in the Horn Peninsula on the Gulf of Aden. The country can be divided into three regions; the coastal plain and volcanic plateaus in the central and southern parts of the country and the mountain ranges in the north. Much of the country is wasteland with virtually no arable land.", Region = "Africa", Subregion = "Eastern Africa")]
        DJ = 62,

        [CustomCountry(Name = "Dominica", FullName = "Commonwealth of Dominica", Capital = "Roseau", Description = "Dominica is a Caribbean island country. It is referred to as the \"Nature Island of the Caribbean\" due to its spectacular, lush, and varied flora and fauna, which are protected by an extensive natural park system. The most mountainous island of the Lesser Antilles, its volcanic peaks are cones of lava craters and include Boiling Lake, the second-largest thermally active lake in the world.", Region = "Americas", Subregion = "Caribbean")]
        DM = 63,

        [CustomCountry(Name = "Dominican Republic", FullName = "Dominican Republic", Capital = "Santo Domingo", Description = "The Dominican Republic is a Caribbean country that occupies the eastern half of the island of Hispaniola, which it shares with Haiti. Besides white sand beaches and mountain landscapes, the country is home to the oldest European city in the Americas, now part of Santo Domingo. Due to its Hispanic heritage, the Dominican Republic is called the Cradle of the Americas.", Region = "Americas", Subregion = "Caribbean")]
        DO = 64,

        [CustomCountry(Name = "Ecuador", FullName = "Republic of Ecuador", Capital = "Quito", Description = "Ecuador is a country on the Equator in northwestern South America. Several places in the country have been declared UNESCO World Heritage Sites, including the Galapagos Islands and the cities of Quito and Cuenca, which lie in the Andes that run from north to south through the country. The Ecuadorian Andes are also home to some of the highest active volcanoes such as the Cotopaxi.", Region = "Americas", Subregion = "South America")]
        EC = 65,

        [CustomCountry(Name = "Egypt", FullName = "Arab Republic of Egypt", Capital = "Cairo", Description = "Egypt is known for its world-famous pyramids, mummies, temples, art, churches, mosques, bustling cities, friendly people, and hieroglyphics, Egypt is considered a cradle of civilization and has one of the longest histories of any country in the world. Egypt may perhaps have the oldest tourist industry in the world; Egypt has been visited by millions of people since ancient times.", Region = "Africa", Subregion = "Northern Africa")]
        EG = 66,

        [CustomCountry(Name = "El Salvador", FullName = "Republic of El Salvador", Capital = "San Salvador", Description = "El Salvador has many natural riches, such as beautiful and secluded beaches on the Pacific coast of Central America, majestic forests in the mountains and striking volcanoes. The countryside of El Salvador is breathtaking, with volcanoes and mountains offering \"green\" adventurers exactly what they are looking for. Many environmentally-oriented community-based organizations promote eco-tourism.", Region = "Americas", Subregion = "Central America")]
        SV = 67,

        [CustomCountry(Name = "Equatorial Guinea", FullName = "Republic of Equatorial Guinea", Capital = "Malabo", Description = "Equatorial Guinea is a small country in Central Africa that's divided into two parts: the mainland and Bioko Island where the capital is located. The mainland is wedged between Cameroon and Gabon. It is one of the largest oil producers in Africa, along with Angola and Nigeria.", Region = "Africa", Subregion = "Middle Africa")]
        GQ = 68,

        [CustomCountry(Name = "Eritrea", FullName = "State of Eritrea", Capital = "Asmara", Description = "Eritrea is a country in East Africa. Formerly an Italian colony, the country shares a common language and culture with its large neighbor, Ethiopia, which it was once a part of until Eritrea gained its independence in 1993. It used to be Africa's youngest country until 2011, which was when South Sudan gained its independence.", Region = "Africa", Subregion = "Eastern Africa")]
        ER = 69,

        [CustomCountry(Name = "Estonia", FullName = "Republic of Estonia", Capital = "Tallinn", Description = "Estonia is a Baltic gem offering visitors the chance to see a tiny dynamic land on the shores of the sea. The northernmost and smallest of the Baltic states, Estonia has charming old towns and heritage back to the Hanseatic League. Tallinn's old town was built in the Middle Ages, but is in magnificent condition, with the city walls and towers almost completely intact, and it rates as one of Europe's best medieval old towns.", Region = "Europe", Subregion = "Northern Europe")]
        EE = 70,

        [CustomCountry(Name = "Eswatini", FullName = "Kingdom of Eswatini", Capital = "Mbabane", Description = "The Kingdom of Eswatini, formerly known as Swaziland, is a landlocked country in Southern Africa and is informally known as \"Africa in a nutshell\".", Region = "Africa", Subregion = "Southern Africa")]
        SZ = 71,

        [CustomCountry(Name = "Ethiopia", FullName = "Federal Democratic Republic of Ethiopia", Capital = "Addis Ababa", Description = "Travelers to Ethiopia experience a country divided into two: in the north and east the focus is on cultural heritage, while in the south there are several national parks and lakes in the area of the East African Rift with their flora and fauna as well as the habitat of several indigenous peoples.", Region = "Africa", Subregion = "Eastern Africa")]
        ET = 72,

        [CustomCountry(Name = "Falkland Islands", FullName = "Falkland Islands", Capital = "Stanley", Description = "The Falkland Islands consist of two main islands and several hundred smaller islands in the south Atlantic Ocean, off the east coast of southern South America. They are a British Overseas Territory, but nearby Argentina claims jurisdiction under the name Islas Malvinas. Most visitors to the islands come between October and March to enjoy the spectacular wildlife and hardy rural lifestyle.", Region = "Americas", Subregion = "South America")]
        FK = 73,

        [CustomCountry(Name = "Faroe Islands", FullName = "Faroe Islands", Capital = "Tórshavn", Description = "The Faroe or Faeroe Islands are an archipelago of 18 islands in the middle of the North Atlantic Ocean, with roughly 54,000 inhabitants (2022). Like Greenland, the Faroe Islands are an autonomous territory of Denmark.", Region = "Europe", Subregion = "Northern Europe")]
        FO = 74,

        [CustomCountry(Name = "Fiji", FullName = "Republic of Fiji", Capital = "Suva", Description = "Fiji is an archipelago nation in Melanesia in the Pacific Ocean. It lies 2000 km north of New Zealand and consists of 332 islands, Viti Levu and Vanua Levu being the largest ones.", Region = "Oceania", Subregion = "Melanesia")]
        FJ = 75,

        [CustomCountry(Name = "Finland", FullName = "Republic of Finland", Capital = "Helsinki", Description = "Finland is a country with vast areas of unspoiled nature speckled with comfortable small towns and cities. Scraped flat by sheets of ice during several ice ages, Finland lacks the dramatic mountains and fjords of its Nordic neighbors but makes up for it with 188,000 lakes and a similar number of islands. Finland extends into the Arctic, where the Northern Lights and the Midnight Sun can be seen. The mythical mountain of Korvatunturi is said to be the home of Santa Claus, and there is a Santaland in Rovaniemi.", Region = "Europe", Subregion = "Northern Europe")]
        FI = 76,

        [CustomCountry(Name = "France", FullName = "French Republic", Capital = "Paris", Description = "France is a country with which almost every traveler has a relationship. Many dream of its joie de vivre shown by the countless cafés, picturesque villages, and world-famous gastronomy. Some come to follow the trail of France's great philosophers, writers and artists, or to immerse in the beautiful language it gave to the world. Others still are drawn to the country's geographical diversity, with its long coastlines, massive mountain ranges and breathtaking farmland vistas. France is famously home to Paris, the enchanting City of Love, where romance dances in the air and every corner whispers sweet nothings.", Region = "Europe", Subregion = "Western Europe")]
        FR = 77,

        [CustomCountry(Name = "French Guiana", FullName = "Guiana", Capital = "Cayenne", Description = "French Guiana is an overseas French department and region in the Amazonia region of South America, bordering the North Atlantic Ocean, between Brazil and Suriname. It is governed as an overseas department of France with the same rights and privileges granted to all other French departments, and it benefits financially from the arrangement.", Region = "Americas", Subregion = "South America")]
        GF = 78,

        [CustomCountry(Name = "French Polynesia", FullName = "French Polynesia", Capital = "Papeete", Description = "French Polynesia is a collection of over 100 islands halfway between California and Australia in the South Pacific Ocean. It is an overseas country governed by France. French Polynesia is and has been the dream destination of travelers for many decades; you don't get much more beautiful, or expensive, than this.", Region = "Oceania", Subregion = "Polynesia")]
        PF = 79,

        [CustomCountry(Name = "French Southern Territories", FullName = "French Southern and Antarctic Lands", Capital = "", Description = "French Southern and Antarctic Lands are a group of islands of the Indian Ocean, about equidistant between Africa, Antarctica, and mainland Australia along with a narrow strip of Antarctica, known as Adélie Land.", Region = "Africa", Subregion = "Southern Africa")]
        TF = 80,

        [CustomCountry(Name = "Gabon", FullName = "Gabonese Republic", Capital = "Libreville", Description = "Gabon is a country in Central Africa with an array of landscapes and wildlife in its 13 national parks.", Region = "Africa", Subregion = "Middle Africa")]
        GA = 81,

        [CustomCountry(Name = "Gambia", FullName = "Republic of The Gambia", Capital = "Banjul", Description = "The Gambia is a small, narrow country along the length of the Gambia River in West Africa, almost completely surrounded by Senegal. Besides beaches and wildlife, The Gambia is known for the town of Juffureh, made famous by Alex Haley's Roots. It is known as the Smiling Coast.", Region = "Africa", Subregion = "Western Africa")]
        GM = 82,

        [CustomCountry(Name = "Georgia", FullName = "Georgia", Capital = "Tbilisi", Description = "Georgia is a country in the Caucasus. Sandwiched between Russia in the north and Turkey in the south, it sits along the coast of the Black Sea around where Europe and Asia meet. It is a rather mountainous country and is home to some of Europe’s highest mountain peaks. Despite its modest size, Georgia presents a large mix of other landscapes and micro-climates, ranging from dry wine-growing valleys in the east, to lush Black Sea resorts in the west.", Region = "Asia", Subregion = "Western Asia")]
        GE = 83,

        [CustomCountry(Name = "Germany", FullName = "Federal Republic of Germany", Capital = "Berlin", Description = "Germany is the largest country in Central Europe. It is known for its rich cultural heritage, innovative inventions, its old-world charm and Gemütlichkeit (cosiness). Discard any perceptions of Germany as being homogeneous; a country of surprising regional diversity awaits your presence. Many tourists visit Germany to experience European history and the diverse German landscape. German culture, outdoor activities, German holidays and festivities, the countryside and rural areas, and the German cities are identified as being big draws for visitors.", Region = "Europe", Subregion = "Western Europe")]
        DE = 84,

        [CustomCountry(Name = "Ghana", FullName = "Republic of Ghana", Capital = "Accra", Description = "Ghana is a country in West Africa. It's a gratifying destination for first-time visitors to West Africa, owing to its good infrastructure, political stability and widespread use of English. The people are generally very helpful and welcoming. While their laid-back attitude and a lack of organised tourist sights or trips can be a little annoying to begin with, you'll quickly realise that it is one of the delights of this country.", Region = "Africa", Subregion = "Western Africa")]
        GH = 85,

        [CustomCountry(Name = "Gibraltar", FullName = "Gibraltar", Capital = "Gibraltar", Description = "Gibraltar, colloquially known as The Rock or Gib, is an overseas territory of the United Kingdom at the entrance to the Mediterranean Sea. It is bordered by Spain to the north, while Morocco is a short distance across the strait to the south. Gibraltar has a population of 34,000 as of 2020.", Region = "Europe", Subregion = "Southern Europe")]
        GI = 86,

        [CustomCountry(Name = "Greece", FullName = "Hellenic Republic", Capital = "Athens", Description = "Greece is a country with a captivating history and culture that has influenced the world for thousands of years.", Region = "Europe", Subregion = "Southern Europe")]
        GR = 87,

        [CustomCountry(Name = "Greenland", FullName = "Greenland", Capital = "Nuuk", Description = "Greenland is the world's largest non-continental island, in the Arctic far north-east of North America. For thousands of years this icy landmass has been inhabited by Arctic peoples. In the 10th century, it was settled by Vikings, and to this day it is part of the Danish Realm.", Region = "Americas", Subregion = "North America")]
        GL = 88,

        [CustomCountry(Name = "Grenada", FullName = "Grenada", Capital = "St. George's", Description = "Grenada is a group of three larger islands and several tiny islands in the Caribbean, or West Indies. It lies just north of Trinidad and Tobago, and southwest of Saint Vincent and the Grenadines. It's known as the \"Spice Isle\", being a major source of nutmeg, cloves, ginger, cinnamon, vanilla and cocoa. In 2022 the population was 125,000, heavily concentrated in the southwest of Grenada main island.", Region = "Americas", Subregion = "Caribbean")]
        GD = 89,

        [CustomCountry(Name = "Guadeloupe", FullName = "Guadeloupe", Capital = "Basse-Terre", Description = "Guadeloupe, known as Gwadloup in the local creole, and sometimes known as the Butterfly Island on account of the shape of two of its major islands, is a group of islands in the eastern Caribbean, and is a French overseas department, southeast of Puerto Rico.", Region = "Americas", Subregion = "Caribbean")]
        GP = 90,

        [CustomCountry(Name = "Guam", FullName = "Guam", Capital = "Hagåtña", Description = "Guam is an island in the western Pacific Ocean, about three-quarters of the way from Hawaii to the Philippines. An unincorporated territory of the United States of America, Guam gets most of its visitors from East Asia, especially Japan.", Region = "Oceania", Subregion = "Micronesia")]
        GU = 91,

        [CustomCountry(Name = "Guatemala", FullName = "Republic of Guatemala", Capital = "Guatemala City", Description = "Guatemala has a rich and distinctive culture from the extended mixing of Spanish settlers and the Maya people who are native to Central America. This diverse history and the natural beauty of the land have created a destination rich in interesting and scenic sites. Guatemala is very tough land—you can experience dense jungles, mountainous terrain with volcanic activity, other seismic activity, and hurricanes.", Region = "Americas", Subregion = "Central America")]
        GT = 92,

        [CustomCountry(Name = "Guernsey", FullName = "Bailiwick of Guernsey", Capital = "St. Peter Port", Description = "The Bailiwick of Guernsey is a group of islands in the English Channel, part of the Channel Islands. Guernsey is the main island, some 50 miles west of the Cotentin Peninsula in France. It's about 6 miles long by 3 miles wide, with St Peter Port as its chief settlement, and in 2019 had a population of almost 63,000.", Region = "Europe", Subregion = "Northern Europe")]
        GG = 93,

        [CustomCountry(Name = "Guinea", FullName = "Republic of Guinea", Capital = "Conakry", Description = "Guinea is a former French colony in West Africa. Guinea has some spectacular landscapes with a few tropical, dry forests remaining, and the rainforests in the south are lush, verdant and full of wildlife — much of it destined for the cooking pot.", Region = "Africa", Subregion = "Western Africa")]
        GN = 94,

        [CustomCountry(Name = "Guinea-Bissau", FullName = "Republic of Guinea-Bissau", Capital = "Bissau", Description = "Guinea-Bissau is an off-the-beaten-path destination on the west coast of Africa. It is primarily an agricultural and fishing country of fewer than 2 million people (2018). This former Portuguese colony is one of the poorest in the world.", Region = "Africa", Subregion = "Western Africa")]
        GW = 95,

        [CustomCountry(Name = "Guyana", FullName = "Co-operative Republic of Guyana", Capital = "Georgetown", Description = "Guyana is an English-speaking country where you can find untouched South American nature, amazing wildlife and birding experiences, rich culture and heritage, and a multiethnic Caribbean vibe. 90% of the population live along the coast, leaving the country's interior untouched, and to be explored.", Region = "Americas", Subregion = "South America")]
        GY = 96,

        [CustomCountry(Name = "Haiti", FullName = "Republic of Haiti", Capital = "Port-au-Prince", Description = "Haiti is a Caribbean country on the western half of the island of Hispaniola. The poorest country in the Western Hemisphere, the country suffers from a myriad of social, economic, and political problems and since the 1950s, it has been in the news for all the wrong reasons. However, for those with patience and an open mind, Haiti reveals a rich culture that is unique among post-colonial nations. This is the only country in the world that was established by a successful slave revolt, the first country in the Americas to abolish slavery, and all of the country's first leaders were former slaves. Haiti has a sizeable diaspora around the world, and many influential figures including W. E. B. Du Bois, Jean Baptiste Point du Sable and former Canadian Governor-General Michaëlle Jean were of Haitian origin.", Region = "Americas", Subregion = "Caribbean")]
        HT = 97,

        [CustomCountry(Name = "Heard Island and McDonald Islands", FullName = "Heard Island and McDonald Islands", Capital = "", Description = "Heard Island and McDonald Islands are uninhabited, barren, Subantarctic islands in the Southern Ocean, far due south of India and roughly 400 km southeast of Kerguelen of the French Southern and Antarctic Lands. The islands are administered by Australia and listed as a UNESCO World Heritage site. Although they are run by Australia, the islands are approximately 4,000 km southwest from Perth.", Region = "Antarctic", Subregion = null)]
        HM = 98,

        [CustomCountry(Name = "Vatican City", FullName = "Vatican City State", Capital = "Vatican City", Description = "Vatican City is the world's smallest country both by area and by population, and is the center of Catholicism. This tiny country completely within Rome is packed with more history and artwork than most cities in the world, and indeed many countries. St. Peter's Basilica, the Vatican Museums and the Sistine Chapel are all in Vatican City.", Region = "Europe", Subregion = "Southern Europe")]
        VA = 99,

        [CustomCountry(Name = "Honduras", FullName = "Republic of Honduras", Capital = "Tegucigalpa", Description = "Honduras has colonial villages, ancient Maya ruins (Copán), natural parks (Moskitia), and a Pacific and Caribbean coastline and the Bay Islands, with great beaches and coral reefs where snorkeling and diving are exceptional by any standard.", Region = "Americas", Subregion = "Central America")]
        HN = 100,

        [CustomCountry(Name = "Hong Kong", FullName = "Hong Kong Special Administrative Region of the People's Republic of China", Capital = "Tamar", Description = "Hong Kong is a place with multiple personalities. The population is mainly Chinese, but British influence is still quite visible. It has absorbed people and cultural influences from places as diverse as Vietnam and Vancouver and proudly proclaims itself to be Asia's World City.", Region = "Asia", Subregion = "Eastern Asia")]
        HK = 101,

        [CustomCountry(Name = "Hungary", FullName = "Hungary", Capital = "Budapest", Description = "Hungary is a small landlocked country in south-eastern Central Europe. It features a gorgeous capital city, Budapest, and the largest lake in Central Europe, Balaton. Hungary offers many diverse destinations: relatively low mountains in the north-west, the Great Plain in the east, lakes and rivers of all sorts, and many beautiful small villages and hidden gems of cities. Top this off with Hungary's great accessibility in the middle of Europe, a vivid culture and economy, and you get a destination absolutely worth visiting.", Region = "Europe", Subregion = "Eastern Europe")]
        HU = 102,

        [CustomCountry(Name = "Iceland", FullName = "Iceland", Capital = "Reykjavík", Description = "Iceland is a stunningly beautiful place if you enjoy strange and desolate landscapes interspersed with glaciers, volcanoes, rivers and waterfalls. It is a place for hiking, ice climbing, kayaking in glacial waters, and relaxing in geothermal hot springs, and there are many tours available for those looking for a less strenuous vacation.", Region = "Europe", Subregion = "Northern Europe")]
        IS = 103,

        [CustomCountry(Name = "India", FullName = "Republic of India", Capital = "New Delhi", Description = "India, the largest country in South Asia, has many of the world's highest mountains, most populated cities, and longest rivers. As one of the great civilizations of the ancient world, India's heritage and culture is a rich amalgam of the past and present. This vast country, the most populous in the world, offers the traveler a view of fascinating religions and ethnography, a smorgasbord of languages, diverse food, and architectural masterpieces that were built millennia ago and remain intact today. As the nation opens up to a globalised world, India still has a depth of history and intensity of culture that awe and fascinate the many who visit there.", Region = "Asia", Subregion = "Southern Asia")]
        IN = 104,

        [CustomCountry(Name = "Indonesia", FullName = "Republic of Indonesia", Capital = "Jakarta", Description = "Indonesia is a huge archipelago of diverse islands scattered over both sides of the Equator between the Indian Ocean and the Pacific Ocean. With extensive rainforests on its 17,000 islands, Indonesia is nicknamed The Emerald of the Equator. Indonesia's best known tourist destination is Bali, but with 6,000 inhabited islands, tourists have a wealth of diversity to explore.", Region = "Asia", Subregion = "South-Eastern Asia")]
        ID = 105,

        [CustomCountry(Name = "Iran", FullName = "Islamic Republic of Iran", Capital = "Tehran", Description = "Iran, formerly Persia, can be considered part of the Middle East or Central Asia; indeed the Persian Empire was the dominant Central Asian power for many centuries. The wellspring of one of the world's great civilizations, Iran is a country of striking natural beauty and gorgeous tiled mosques. Once the center of a pro-Western monarchy, it became an Islamic Republic in 1979, and since then, its history has been tumultuous. Iran is a modern Islamic theocracy whose laws are based on Ja'fari Shia Islam. Today, Iran is a melting pot of different cultures, with Persians, Azerbaijanis, and Kurds constituting the largest ethnic groups. Shia Islam is the state religion, although there is a sizeable portion of Sunnis, as well as long-established Christian, Jewish and Zoroastrian minorities.", Region = "Asia", Subregion = "Southern Asia")]
        IR = 106,

        [CustomCountry(Name = "Iraq", FullName = "Republic of Iraq", Capital = "Baghdad", Description = "Iraq is a republic in the Middle East. It has an extremely rich history and culture that is still visible today, although accessing it may pose some challenges to visitors. It was once host to the region of ancient Mesopotamia, often called the \"cradle of civilization\". After the rise of Islam, Baghdad became a center of learning and the arts during the Islamic Golden Age. Its holy cities of Najaf and Karbala now accept millions of pilgrims per year from throughout the Middle East.", Region = "Asia", Subregion = "Western Asia")]
        IQ = 107,

        [CustomCountry(Name = "Ireland", FullName = "Republic of Ireland", Capital = "Dublin", Description = "Ireland, also known as the Republic of Ireland, has a rich culture that, along with its people, has been exported around the world. Some Irish history has been very dark indeed, but it remains a land of poets, story-tellers, and musicians, with marvelous scenery, an advanced knowledge economy, first-rate infrastructure, and leading industries, with a high gross domestic product and standard of living.", Region = "Europe", Subregion = "Northern Europe")]
        IE = 108,

        [CustomCountry(Name = "Isle of Man", FullName = "Isle of Man", Capital = "Douglas", Description = "The Isle of Man is an island in the British Isles, sitting in the Irish Sea midway between Cumbria in England and County Down in Northern Ireland. It's not part of the United Kingdom but is a Crown Dependency: its own elected parliament, the Tynwald, governs island affairs, but matters such as defence and foreign affairs are governed by the UK. In 2021 its population was 84,000.", Region = "Europe", Subregion = "Northern Europe")]
        IM = 109,

        [CustomCountry(Name = "Israel", FullName = "State of Israel", Capital = "Jerusalem", Description = "Israel is a small yet diverse Middle Eastern country. The modern State of Israel was established in 1948 as a homeland for the Jewish people, but the region contains thousands of years of history for many peoples and religions in addition to the Jews. Israel is considered part of the Holy Land, and of the Levant and in ancient history of the Fertile Crescent. The three major Abrahamic religions of Judaism, Christianity and Islam, as well as the Baha'i Faith, have strong ties to this land, and their holy and historic sites are major destinations for pilgrims and tourists from around the world. The Israeli population is about 74% Jews, 21% Arabs, and 5% non-Arab Christians and others. Most of the Jews are descended from Olim, and their diverse origins can be seen in various aspects of modern Israeli culture.", Region = "Asia", Subregion = "Western Asia")]
        IL = 110,

        [CustomCountry(Name = "Italy", FullName = "Italian Republic", Capital = "Rome", Description = "Italy was once the core of the mighty Roman Empire, and the cradle of the Renaissance. Along with Greece, it is regarded as the \"birthplace\" of Western culture, and it is also home to the greatest number of UNESCO World Heritage Sites in the world, including high art and monuments.", Region = "Europe", Subregion = "Southern Europe")]
        IT = 111,

        [CustomCountry(Name = "Jamaica", FullName = "Jamaica", Capital = "Kingston", Description = "Jamaica is an island nation in the Caribbean that attracts sunseekers for its laid-back beach culture, and music fans on the trail of Jamaica's most famous son, reggae legend Bob Marley. Tourists flock to the island's northern coast, including the communities of Montego Bay, Ocho Rios, and Port Antonio, and in Negril on the island's western tip. Dynamic in its African heritage, Jamaica offers a lively atmosphere in its tropical feel.", Region = "Americas", Subregion = "Caribbean")]
        JM = 112,

        [CustomCountry(Name = "Japan", FullName = "Japan", Capital = "Tokyo", Description = "Japan, known as Nihon or Nippon (日本) in Japanese, is an island nation in East Asia. Its insular character has allowed it to develop a unique and very intricate culture, while its closeness to other ancient East Asian cultures, in particular China, has left lasting influence. Despite belonging to a nation long at war, Japan's people have always placed emphasis on inner balance, tranquility and natural beauty. These traditional values have become increasingly important now that Japan has grown to be one of the world's most densely-populated countries, and its legendary work ethic makes life in its cities quite hectic.", Region = "Asia", Subregion = "Eastern Asia")]
        JP = 113,

        [CustomCountry(Name = "Jersey", FullName = "Bailiwick of Jersey", Capital = "St. Helier", Description = "Jersey is the largest and southernmost of the Channel Islands. It's a self-governing dependency of the British Crown, but not part of the United Kingdom. It lies 14 miles west of the Cherbourg peninsula of France in the Bay of St Malo, rather than in the Channel proper.", Region = "Europe", Subregion = "Northern Europe")]
        JE = 114,

        [CustomCountry(Name = "Jordan", FullName = "Hashemite Kingdom of Jordan", Capital = "Amman", Description = "Jordan is an Arab kingdom in the Middle East, at the crossroads of Asia, Africa and Europe. It has been repeatedly called an \"oasis of stability\" in the Middle East. Since the 1940s, millions have immigrated to Jordan for a better life. With an extensive collection of tourist attractions, ranging from biblical sites to seaside sites, there is a lot to see and do in Jordan.", Region = "Asia", Subregion = "Western Asia")]
        JO = 115,

        [CustomCountry(Name = "Kazakhstan", FullName = "Republic of Kazakhstan", Capital = "Astana", Description = "Kazakhstan is the largest of the states of the former Soviet Union apart from Russia, and it dwarfs the other countries of Central Asia and stretches into Eastern Europe. Kazakhstan is the richest country in the region due to its large oil and natural gas reserves and is also the largest in Central Asia. And while the endless, featureless steppe might repel some visitors the emptiness and mystery of this goliath state keeps many others captivated.", Region = "Asia", Subregion = "Central Asia")]
        KZ = 116,

        [CustomCountry(Name = "Kenya", FullName = "Republic of Kenya", Capital = "Nairobi", Description = "Kenya in East Africa is a pearl in sub-Saharan Africa. From the scenic sandy beaches at the coast, to the Nairobi National Park, to the majestic Rift Valley, the bird life in Lake Naivasha, the hot boiling springs of Lake Baringo, Lake Turkana and Lake Victoria, Kenya is a very beautiful country with lots of wildlife and scenic features, and is one of the major economic hubs in Africa. Fondly referred to the \"Jewel of Africa\", Kenya is a dream destination for its Swahili heritage and the home of humankind and Safari industry.", Region = "Africa", Subregion = "Eastern Africa")]
        KE = 117,

        [CustomCountry(Name = "Kiribati", FullName = "Independent and Sovereign Republic of Kiribati", Capital = "South Tarawa", Description = "Kiribati is a remote archipelago nation in Micronesia, at the equator. It consists of 33 atolls widely dispersed through 3.5 million km² of sea territory. Kiribati is a tranquil paradise. While most of its local lifestyle remains communal, its main highlight are aquamarine waters set around an 800-km² island backdrop.", Region = "Oceania", Subregion = "Micronesia")]
        KI = 118,

        [CustomCountry(Name = "Kosovo", FullName = "Republic of Kosovo", Capital = "Pristina", Description = "Kosovo, Kosova or Kosovë is a largely mountainous country in the Balkan region of Europe. Its attractions for travelers include its archaeological and religious heritage, natural beauty, hiking and skiing. Kosovo has Ottoman, Christian Orthodox and modernist heritage to share with the world. Being still new to tourists, Kosovars are welcoming to foreign visitors and happy to help. Kosovo declared its independence from Serbia in 2008, which still opposes the act.", Region = "Europe", Subregion = "Southern Europe")]
        XK = 119,

        [CustomCountry(Name = "North Korea", FullName = "Democratic People's Republic of Korea", Capital = "Pyongyang", Description = "North Korea, officially the Democratic People's Republic of Korea or DPRK is the world's most isolated country and has usually been referred to as the \"Hermit Kingdom\". It's located in East Asia on the Korean Peninsula, which has been divided between North and South Korea since the 1950s.", Region = "Asia", Subregion = "Eastern Asia")]
        KP = 120,

        [CustomCountry(Name = "South Korea", FullName = "Republic of Korea", Capital = "Seoul", Description = "South Korea, officially the Republic of Korea, is a country in East Asia.", Region = "Asia", Subregion = "Eastern Asia")]
        KR = 121,

        [CustomCountry(Name = "Kuwait", FullName = "State of Kuwait", Capital = "Kuwait City", Description = "Kuwait is a monarchy situated at the Persian Gulf, nestled between Iraq and Saudi Arabia. Historically, Kuwait was a strategic trade port between Mesopotamia, India, and Persia. Like many of its neighbours, Kuwait is endowed with oil and gas wealth.", Region = "Asia", Subregion = "Western Asia")]
        KW = 122,

        [CustomCountry(Name = "Kyrgyzstan", FullName = "Kyrgyz Republic", Capital = "Bishkek", Description = "Kyrgyzstan, is a Central Asian country. Due to its mountainous terrain, it is often called as the \"Switzerland\" of Central Asia. The country offers breathtaking landscapes, including the Tien Shan Mountains, crystal-clear lakes such as Issyk-Kul and Song Kol, and beautiful valleys like the Ala-Archa National Park. These areas provide excellent hiking, trekking, horseback riding, and camping opportunities.", Region = "Asia", Subregion = "Central Asia")]
        KG = 123,

        [CustomCountry(Name = "Laos", FullName = "Lao People's Democratic Republic", Capital = "Vientiane", Description = "Laos is the only landlocked nation in Southeast Asia. Formerly a French colony, it is one of the few remaining communist states in the world, but Laotian official ideology is closer to the Chinese one. Two thirds of Laotians are practicing Buddhists, the Laotian government actively encourages foreign investment and tourism, and your words and actions are not heavily regulated and monitored.", Region = "Asia", Subregion = "South-Eastern Asia")]
        LA = 124,

        [CustomCountry(Name = "Latvia", FullName = "Republic of Latvia", Capital = "Riga", Description = "Latvia is one of the three Baltic states in Europe. The biggest travel destination in the country is the capital Riga, whose Old Town is a World Heritage Site. There are many other great places to see, both urban and rural. Latvia's unspoilt sea coast is a 500-km-long unique biome, mainly consisting of empty beaches, white soft sand, and dunes covered with pine trees. Forests cover approximately half of Latvia's territory and are home to many nature trails, nature parks and wildlife preserves. The city of Liepāja with its magnificent beach and the unique formerly secret military neighbourhood of Karosta, Kuldīga, recognized in 2023 as a UNESCO world heritage site, with Europe's widest waterfall, and Cēsis with its medieval castle ruins are just some of the various sights.", Region = "Europe", Subregion = "Northern Europe")]
        LV = 125,

        [CustomCountry(Name = "Lebanon", FullName = "Lebanese Republic", Capital = "Beirut", Description = "Lebanon is a country in the Middle East, on the Mediterranean Sea. Rich in diversity and history, Lebanon has hosted the Roman Empire, the Crusades, the Ottoman Empire, and was, for a period of time, controlled by France. The majority of Lebanese are Arabs, as are most of the Palestinians and Syrians living there, but there are also small communities of Assyrians, Armenians and Kurds. Lebanese cuisine is among the most famous of all Middle Eastern cuisines.", Region = "Asia", Subregion = "Western Asia")]
        LB = 126,

        [CustomCountry(Name = "Lesotho", FullName = "Kingdom of Lesotho", Capital = "Maseru", Description = "Lesotho is a small country entirely surrounded by South Africa. It's known as the \"Kingdom in the Sky\" because the entire country is at a high altitude. Its lowest point is 1,388 m (4,554 ft) above sea level; no other country in the world has its lowest point above 1,000 m (3,300 ft). Lesotho is a fantastic adventure holiday destination because of its smiling and resourceful people and bracing climate.", Region = "Africa", Subregion = "Southern Africa")]
        LS = 127,

        [CustomCountry(Name = "Liberia", FullName = "Republic of Liberia", Capital = "Monrovia", Description = "Liberia, in West Africa, is a wonderful place to immerse yourself in the local culture. Liberia has a thriving music scene, known as hip co, which blends hip hop with colloquial Liberian English. Artists like Takun J, Santos, Mr. Smith, Soul Smiter, and Nasseman are popular. In the dry season, especially, concerts are regularly held at venues across the country.", Region = "Africa", Subregion = "Western Africa")]
        LR = 128,

        [CustomCountry(Name = "Libya", FullName = "State of Libya", Capital = "Tripoli", Description = "Libya is a country in the Maghreb region of North Africa and a part of the Arab world. Although the country is rich in history and culture and has great tourism potential, the country has been in the news for all the wrong reasons since the 1960s. Since the 2010s, the country has been in a state of flux and is rather dangerous to travel to.", Region = "Africa", Subregion = "Northern Africa")]
        LY = 129,

        [CustomCountry(Name = "Liechtenstein", FullName = "Principality of Liechtenstein", Capital = "Vaduz", Description = "The Principality of Liechtenstein is a tiny, alpine, German-speaking country with a population of 38,000, doubly landlocked by Switzerland and Austria.", Region = "Europe", Subregion = "Western Europe")]
        LI = 130,

        [CustomCountry(Name = "Lithuania", FullName = "Republic of Lithuania", Capital = "Vilnius", Description = "Lithuania is one of the three Baltic states of northeast Europe. It's a low-lying, mostly agricultural country bordered by Latvia to the north and east, Belarus to the south, Poland to the southwest, Kaliningrad exclave of Russia to the west, and the Baltic Sea to the northwest. It broke away from the Soviet Union to become an independent republic in 1990, soon followed by Latvia and Estonia the other two Baltic states. It is the largest of the three Baltic states, extending to about 65,300 square kilometres with a population of 2.9 million in 2025.", Region = "Europe", Subregion = "Northern Europe")]
        LT = 131,

        [CustomCountry(Name = "Luxembourg", FullName = "Grand Duchy of Luxembourg", Capital = "Luxembourg", Description = "The Grand Duchy of Luxembourg, is a landlocked Benelux country at the crossroads of Germanic and Latin cultures.", Region = "Europe", Subregion = "Western Europe")]
        LU = 132,

        [CustomCountry(Name = "Macao", FullName = "Macao Special Administrative Region of the People's Republic of China", Capital = "Macao", Description = "Macau is a former Portuguese colony, a world-renowned gambling destination, and one of the world's most densely populated places, with a population of 667,000 people (2016) in an area half the size of Manhattan Island. Returned to Chinese rule in 1999, it is now a semi-autonomous \"Special Administrative Region\", a status it shares with nearby Hong Kong.", Region = "Asia", Subregion = "Eastern Asia")]
        MO = 133,

        [CustomCountry(Name = "Madagascar", FullName = "Republic of Madagascar", Capital = "Antananarivo", Description = "Madagascar is a country in the Indian Ocean off the eastern coast of Africa. It is known for its particularly unique wildlife and flora. Madagascar split from India approximately 88 million years ago, and as a result of its long isolation it is home to a massive number of unique plant and animal species, with over 90% of its wildlife and 80% of its plants found nowhere else on the planet.", Region = "Africa", Subregion = "Eastern Africa")]
        MG = 134,

        [CustomCountry(Name = "Malawi", FullName = "Republic of Malawi", Capital = "Lilongwe", Description = "Malawi is a small, landlocked country in Africa whose eastern border mostly follows Lake Malawi, the third largest lake on the continent. It's described as the \"Warm Heart of Africa\", referring to the friendliness of the people.", Region = "Africa", Subregion = "Eastern Africa")]
        MW = 135,

        [CustomCountry(Name = "Malaysia", FullName = "Malaysia", Capital = "Kuala Lumpur", Description = "Malaysia is a country in Southeast Asia, on the Malay Peninsula, as well as on northern Borneo. The country is one of Asia's tiger economies, having seen great economic and human development during the last several decades. While the capital Kuala Lumpur is a cosmopolitan city, deep jungles cover vast swaths of the land, and the offshore islands are home to pristine beaches and some of the world's best scuba diving sites. Malaysia is also a foodie's paradise, with its diverse ethnic groups contributing to an incredibly rich culinary heritage.", Region = "Asia", Subregion = "South-Eastern Asia")]
        MY = 136,

        [CustomCountry(Name = "Maldives", FullName = "Republic of the Maldives", Capital = "Malé", Description = "The Maldives are an archipelago in the Indian Ocean with picture-perfect beaches, strikingly blue water, and luxury resorts. There are 200 inhabited islands and 165 islands with tourist resorts. Just under the surface of the beautiful blue ocean, there's a wealth of wildlife to see: over 2000 species of fish in all colours of the rainbow roam the clear waters around the islands.", Region = "Asia", Subregion = "Southern Asia")]
        MV = 137,

        [CustomCountry(Name = "Mali", FullName = "Republic of Mali", Capital = "Bamako", Description = "A landlocked country in the Sahel, Mali remains one of the poorest countries in the world, but it has wonderful musicians and some incredible sights, including four UNESCO World Heritage sites and the historic city of Timbuktu.", Region = "Africa", Subregion = "Western Africa")]
        ML = 138,

        [CustomCountry(Name = "Malta", FullName = "Republic of Malta", Capital = "Valletta", Description = "Malta is an island country in Europe, forming an archipelago in the middle of the Mediterranean Sea, between Sicily and North Africa.", Region = "Europe", Subregion = "Southern Europe")]
        MT = 139,

        [CustomCountry(Name = "Marshall Islands", FullName = "Republic of the Marshall Islands", Capital = "Majuro", Description = "The Marshall Islands are a group of atolls and reefs in the Pacific Ocean, about half-way between Hawaii and Australia. The charm of the Marshall Islands lies not in a great number of attractions. This small country, home to fewer than 70,000 people and comprising 1,156 islands and islets, is, however, unique. Don't expect any spectacular sights, but enjoy the pristine beauty of picture-perfect tropical islands, great scuba diving and windsurfing opportunities and the warm hospitality of the people.", Region = "Oceania", Subregion = "Micronesia")]
        MH = 140,

        [CustomCountry(Name = "Martinique", FullName = "Martinique", Capital = "Fort-de-France", Description = "Martinique is a Caribbean island that is an overseas department of France in the Caribbean Sea, north of Saint Lucia and south of Dominica.", Region = "Americas", Subregion = "Caribbean")]
        MQ = 141,

        [CustomCountry(Name = "Mauritania", FullName = "Islamic Republic of Mauritania", Capital = "Nouakchott", Description = "Mauritania is a land of desert and ocean. It is of course no wonder that the main attractions for most tourists are the desert in Adrar and Tagant areas, and the ocean in Banc d'Arguin.", Region = "Africa", Subregion = "Western Africa")]
        MR = 142,

        [CustomCountry(Name = "Mauritius", FullName = "Republic of Mauritius", Capital = "Port Louis", Description = "Mauritius is an island nation in the Indian Ocean about 2,300 km (1,400 mi) from the African continent. Mauritius is mostly appreciated by visitors for its natural beauty and man-made attractions, multi-ethnic and cultural diversity, tropical climate, beautiful beaches and water sports.", Region = "Africa", Subregion = "Eastern Africa")]
        MU = 143,

        [CustomCountry(Name = "Mayotte", FullName = "Department of Mayotte", Capital = "Mamoudzou", Description = "Mayotte is an archipelago among the East African Islands, lying in the Indian Ocean channel between Madagascar and Mozambique. It's a French overseas department with a population of 299,348 in 2022. Most live on the large island of Grande-Terre, which somewhat resembles a sea horse, used on Mayotte's coat of arms. A 2 km channel separates it from Petite-Terre, also urbanised; the other islets are tiny with only a handful of residents.", Region = "Africa", Subregion = "Eastern Africa")]
        YT = 144,

        [CustomCountry(Name = "Mexico", FullName = "United Mexican States", Capital = "Mexico City", Description = "Mexico is known for its cuisine, art, archaeology, history, pyramids, music, museums, haciendas, 9,600 km of shoreline, superb architecture, weather from snow-capped mountains in the Sierras to rainy jungles in the southeast and desert in the northwest, many golf courses and excellent fishing. Along with Chile, Colombia, and Peru, this once-poor nation is one of the Pacific Pumas, seeing significant economic growth and improved infrastructure during the 21st century.", Region = "Americas", Subregion = "North America")]
        MX = 145,

        [CustomCountry(Name = "Micronesia", FullName = "Federated States of Micronesia", Capital = "Palikir", Description = "Micronesia, in northwest Oceania, is the home of tropical and subtropical islands in the Pacific Ocean. With the exceptions of Kiribati and Nauru, most of Micronesia is associated with the United States.", Region = "Oceania", Subregion = "Micronesia")]
        FM = 146,

        [CustomCountry(Name = "Moldova", FullName = "Republic of Moldova", Capital = "Chișinău", Description = "Moldova is a small, landlocked country nestled between Romania and Ukraine. Moldova is one of the least visited countries in Europe, but adventurous travelers will find some rewarding experiences. Moldova is famous for its wines and its monasteries. You can get winery tours and monastery tours from Chișinău, the capital.", Region = "Europe", Subregion = "Eastern Europe")]
        MD = 147,

        [CustomCountry(Name = "Monaco", FullName = "Principality of Monaco", Capital = "Monaco", Description = "The Principality of Monaco is a wealthy city-state on the Mediterranean Sea, bounded by the French Riviera. Though tiny, the country is packed with entertainment for those with money to burn: think yachts and casinos, plus the annual Formula 1 Grand Prix.", Region = "Europe", Subregion = "Western Europe")]
        MC = 148,

        [CustomCountry(Name = "Mongolia", FullName = "Mongolia", Capital = "Ulaanbaatar", Description = "Mongolia has wide open spaces for experiencing the outdoors for those who want adventure. Its vast and majestic emptiness is the country's enduring appeal: it brings the traveler into a close communion with nature and its nomadic inhabitants. It is one of the last places on earth where nomadic life lives on. The most memorable part of a trip to Mongolia will be its hospitable people. Mongolian culture has much in common with the cultures of Central Asia.", Region = "Asia", Subregion = "Eastern Asia")]
        MN = 149,

        [CustomCountry(Name = "Montenegro", FullName = "Montenegro", Capital = "Podgorica", Description = "Montenegro is a country in the Balkans, on the Adriatic Sea.", Region = "Europe", Subregion = "Southern Europe")]
        ME = 150,

        [CustomCountry(Name = "Montserrat", FullName = "Montserrat", Capital = "Brades", Description = "The British Overseas Territory of Montserrat is an island in the Caribbean, south-east of Puerto Rico.", Region = "Americas", Subregion = "Caribbean")]
        MS = 151,

        [CustomCountry(Name = "Morocco", FullName = "Kingdom of Morocco", Capital = "Rabat", Description = "Morocco is the northwesternmost country in Africa. Morocco has, for most people, been the gateway to Africa. With plenty of attractive locations, historical sights, and unique cultural traditions, there's lots to see and do in this beautiful, mesmerizing country. At just a few hours from the main European cities, Morocco has everything to overwhelm you with the amazing colors, smells and sounds of Islamic Africa. Imagine bustling souqs and spice markets, stunning mosques, white-washed sea side towns and medieval city centers. With panoramic views varying from snow-covered peaks in the High Atlas to the endless sand dunes of the Sahara, no-one ever has to be bored in this beautiful country.", Region = "Africa", Subregion = "Northern Africa")]
        MA = 152,

        [CustomCountry(Name = "Mozambique", FullName = "Republic of Mozambique", Capital = "Maputo", Description = "Mozambique is a country on the Indian Ocean coast of Southern Africa. From the Monte Binga peak, 2,436 m (7,992 ft) high, to the stunning beaches along the coast, Mozambique is a country of contrasts. As well as some of the best colonial era architecture and relics to be found on the continent, Mozambique has also preserved its African cultural heritage, which can be experienced through art, music and food. Its eastern coastline along the Indian Ocean is more than 1,000 km long, a fantastic draw for scuba divers, fishermen, sailors and beach lovers.", Region = "Africa", Subregion = "Eastern Africa")]
        MZ = 153,

        [CustomCountry(Name = "Myanmar", FullName = "Republic of the Union of Myanmar", Capital = "Naypyidaw", Description = "Myanmar, or Burma is a country in Southeast Asia. The country features awe-inspiring ancient temples, lively local markets, and captivating landscapes, such as unspoiled beaches, picturesque hills, and verdant forests. The genuine warmth of the Burmese people, combined with delectable cuisine, creates an ideal destination for gastronomes and culture aficionados alike.", Region = "Asia", Subregion = "South-Eastern Asia")]
        MM = 154,

        [CustomCountry(Name = "Namibia", FullName = "Republic of Namibia", Capital = "Windhoek", Description = "Namibia, in Southern Africa, boasts remarkable natural attractions such as the Namib Desert, the Fish River Canyon Park, Etosha National Park and the Kalahari Desert. Thanks to both a wealth of indigenous cultures and a tumultuous colonial history, its people speak nine different languages, including some of the Khoisan languages which include the 'clicks' that present an enigma to most native English speakers. It is also one of the few places outside Central Europe where German, although not official, remains a commonly spoken language, while Afrikaans, shared with its southern neighbour, is also prevalent.", Region = "Africa", Subregion = "Southern Africa")]
        NA = 155,

        [CustomCountry(Name = "Nauru", FullName = "Republic of Nauru", Capital = "Yaren", Description = "Nauru is a small island in the South Pacific Ocean south of the Marshall Islands and is the world's third-smallest country; only Monaco and the Vatican City are smaller. An off-the-beaten-track destination if there ever was one, Nauru is also one of the least visited countries in the world, with about only 200 tourists a year. The remoteness and the fact that much of the island is a charmless open phosphate mine are two strong reasons for this.", Region = "Oceania", Subregion = "Micronesia")]
        NR = 156,

        [CustomCountry(Name = "Nepal", FullName = "Federal Democratic Republic of Nepal", Capital = "Kathmandu", Description = "Nepal is a landlocked country in the Himalayas in South Asia. It has eight of the world's 10 highest peaks, including Mount Everest, the world's tallest, on the border with Tibet, as well as Lumbini, the birthplace of Gautama Buddha, the founder of Buddhism.", Region = "Asia", Subregion = "Southern Asia")]
        NP = 157,

        [CustomCountry(Name = "Netherlands", FullName = "Kingdom of the Netherlands", Capital = "Amsterdam", Description = "The Netherlands is a charming small country in the low-lying river delta of northwestern Europe. Its landscape of famously flat lands, much of it reclaimed from the sea, is dotted with windmills, blooming tulip fields and picturesque villages. The modern architecture and urban environments of quite a few cities are also becoming internationally prominent. With over 17 million people living in a relatively small area, this is a densely populated modern European country. Still, even the largest of its cities have retained elements of a laid-back, small-town atmosphere, and most are packed with historic heritage, for which there is much local pride.", Region = "Europe", Subregion = "Western Europe")]
        NL = 158,

        [CustomCountry(Name = "New Caledonia", FullName = "New Caledonia", Capital = "Nouméa", Description = "New Caledonia is a dependent overseas territory of France lying in the western Pacific Ocean, in the Coral Sea, to the east of Australia and west of Vanuatu. The territory consists of the main island of Grande Terre, the archipelago of the Loyalty Islands, and numerous small, sparsely populated islands and atolls.", Region = "Oceania", Subregion = "Melanesia")]
        NC = 159,

        [CustomCountry(Name = "New Zealand", FullName = "New Zealand", Capital = "Wellington", Description = "New Zealand is one of the most beautiful countries in the world, a country of stunning and diverse natural beauty: jagged mountains, rolling pasture land, steep fiords, pristine trout-filled lakes, raging rivers, scenic beaches, and active volcanic zones. These islands form a unique bioregion inhabited by flightless birds seen nowhere else, such as kākāpō and kiwi. New Zealanders have adopted the kiwi as a national symbol, and have even taken the word Kiwi as a name for themselves.", Region = "Oceania", Subregion = "Australia and New Zealand")]
        NZ = 160,

        [CustomCountry(Name = "Nicaragua", FullName = "Republic of Nicaragua", Capital = "Managua", Description = "Nicaragua is the largest country in Central America by area and the least densely populated. Nicaraguans like to refer to their country as the \"país de lagos y volcanes\"; the country of lakes and volcanoes. And those are indeed striking features as Nicaragua contains the largest freshwater body in Central America, Lake Nicaragua or Cocibolca. Inside Lake Nicaragua the famed Volcano Concepcion on Ometepe rises to about a mile in altitude, but other volcanoes such as Momotombo or Mombacho are also impressive.", Region = "Americas", Subregion = "Central America")]
        NI = 161,

        [CustomCountry(Name = "Niger", FullName = "Republic of Niger", Capital = "Niamey", Description = "Niger is a large, arid, landlocked country situated in the Sahel. Formerly a French colony, Niger is one of the poorest countries in the world and is largely agrarian. Negative things aside, Nigeriens in general are quite friendly and down-to earth, and you can expect to come across numerous curious faces during your stay. Chances are, you may be the first person from your country they have ever met.", Region = "Africa", Subregion = "Western Africa")]
        NE = 162,

        [CustomCountry(Name = "Nigeria", FullName = "Federal Republic of Nigeria", Capital = "Abuja", Description = "Nigeria is a large country in equatorial West Africa. Often regarded as the \"Giant of Africa\", Nigeria is the most populous country in Africa, with about 216 million people in 2022. Rich in diversity and landscapes, the country is home to more than 250 ethnic groups and 500 languages.", Region = "Africa", Subregion = "Western Africa")]
        NG = 163,

        [CustomCountry(Name = "Niue", FullName = "Niue", Capital = "Alofi", Description = "Niue is an island in Oceania approximately halfway between Tonga and the Cook Islands. With a population of only 1,600, it is one of the world's least populous countries.", Region = "Oceania", Subregion = "Polynesia")]
        NU = 164,

        [CustomCountry(Name = "Norfolk Island", FullName = "Norfolk Island", Capital = "Kingston", Description = "Norfolk Island is an island in Melanesia, administered by Australia. It is 1,600 km (1,000 mi) east of Sydney and Brisbane and 1,000 km (620 mi) northwest of Auckland. It's a great destination for relaxation, with a range of accommodation and dining, beautiful vistas, complex history and tropical reefs. It also holds a deep convict history, with the convict sites part of a UNESCO World Heritage Site.", Region = "Oceania", Subregion = "Australia and New Zealand")]
        NF = 165,

        [CustomCountry(Name = "North Macedonia", FullName = "Republic of North Macedonia", Capital = "Skopje", Description = "The Republic of North Macedonia, mostly still referred to as simply Macedonia by its residents, is a landlocked country in the heart of the Balkans. The country has an ethnically diverse population sharing an often ruggedly beautiful landscape. Architecture from the bygone eras of the Ottoman Empire and socialist Yugoslavia remains and now contrasts with the modern structures of independent Macedonia. Relative to other European nations, Macedonia is off the beaten path, and tourist infrastructure is underdeveloped and occasionally challenging to navigate.", Region = "Europe", Subregion = "Southern Europe")]
        MK = 166,

        [CustomCountry(Name = "Northern Mariana Islands", FullName = "Commonwealth of the Northern Mariana Islands", Capital = "Saipan", Description = "The Commonwealth of the Northern Mariana Islands (CNMI) is a territory of the United States in Micronesia, visited mainly by tourists from East Asia. The Marianas' top activity among Americans is scuba diving and snorkeling. In addition to the coral reefs you might expect, the waters around the islands were the scene of fierce fighting during World War II and there are many ship wrecks and even rusting tanks stuck on the seabed. Many Asian visitors come to the CNMI for gambling, and karaoke/hostess bars.", Region = "Oceania", Subregion = "Micronesia")]
        MP = 167,

        [CustomCountry(Name = "Norway", FullName = "Kingdom of Norway", Capital = "Oslo", Description = "Norway is a land of great fjords, great valleys, wide forests and gorgeous lakes. It also hosts lively cities such as Oslo and Bergen. Norway is the westernmost, northernmost and, surprisingly, the easternmost of the Scandinavian countries – among the Nordic countries only Finland stretches slightly further east. See the midnight sun, watch the Northern Lights, live its rich cultural heritage and eye its distinctive architecture, all the while being tucked within some of the most beautiful landscapes on Earth.", Region = "Europe", Subregion = "Northern Europe")]
        NO = 168,

        [CustomCountry(Name = "Oman", FullName = "Sultanate of Oman", Capital = "Muscat", Description = "The Sultanate of Oman is on the eastern side of the Arabian Peninsula. Under the radar of most visitors to the Gulf, Oman is peaceful and prosperous, with amazing natural sights and hospitable people.", Region = "Asia", Subregion = "Western Asia")]
        OM = 169,

        [CustomCountry(Name = "Pakistan", FullName = "Islamic Republic of Pakistan", Capital = "Islamabad", Description = "The Islamic Republic of Pakistan is a country at the crossroads of Western, Central, South and East Asia. Conceived as a separate homeland for Muslims in South Asia, the country's tourism industry had its heyday during the 1960s thanks to the Hippie Trail. Unfortunately, the country has been in a state of flux since the 1970s, with many countries declaring it unsafe to visit.", Region = "Asia", Subregion = "Southern Asia")]
        PK = 170,

        [CustomCountry(Name = "Palau", FullName = "Republic of Palau", Capital = "Ngerulmud", Description = "Palau (Belau) is a group of more than 300 tropical islands in the Micronesia area of the Pacific Ocean, to the southeast of the Philippines.", Region = "Oceania", Subregion = "Micronesia")]
        PW = 171,

        [CustomCountry(Name = "Palestine", FullName = "State of Palestine", Capital = "Jerusalem", Description = "The Palestinian territories, also known as Palestine or the State of Palestine, consists of two physically separate entities, the West Bank and the Gaza Strip, in the Middle East. Their political status is controversial, and they have been under varying degrees of Israeli occupation since 1967. The Palestinian National Authority (PNA), controlled by Fatah, administers parts of the West Bank, while Hamas does so in the Gaza Strip. While parts of the territories aren't safe for ordinary travelers, other areas, especially ancient Holy Land cities, are popular destinations and pilgrimage sites.", Region = "Asia", Subregion = "Western Asia")]
        PS = 172,

        [CustomCountry(Name = "Panama", FullName = "Republic of Panama", Capital = "Panama City", Description = "Panama is a country at the southern end of Central America. The country is known as the \"Crossroads of the Americas\" due to its location between North and South America. Its name, given by Indigenous peoples, means \"abundance of fish,\" reflecting the country's status as a paradise for water sports lovers and eco-tourists.", Region = "Americas", Subregion = "Central America")]
        PA = 173,

        [CustomCountry(Name = "Papua New Guinea", FullName = "Independent State of Papua New Guinea", Capital = "Port Moresby", Description = "The Independent State of Papua New Guinea comprises the eastern part of the world's largest and highest tropical island, New Guinea, together with many smaller offshore islands.", Region = "Oceania", Subregion = "Melanesia")]
        PG = 174,

        [CustomCountry(Name = "Paraguay", FullName = "Republic of Paraguay", Capital = "Asunción", Description = "Paraguay is a country of big rivers, green landscapes, folklore and a rich indigenous culture in central South America. It's relatively small compared to its neighbors, with an area of 406,752 km2: about the same size as Germany. Paraguay is lacking in world-famous attractions, and tourist-oriented establishments are few and far between. But those visitors who do come will be rewarded with a great experience of South America: colonial history, ruins of missions, vast wilderness, and a strong mix of European and indigenous cultures.", Region = "Americas", Subregion = "South America")]
        PY = 175,

        [CustomCountry(Name = "Peru", FullName = "Republic of Peru", Capital = "Lima", Description = "Peru is without a doubt one of the most captivating countries in South America. Home of the epic lost Inca citadel of Machu Picchu and the mind-blowing Nazca Lines, this country's unique past awakens the adventurer in travellers of all sorts. Its awe-inspiring scenery varies from the wild Amazon jungles to vast coastal deserts and the icy peaks of the Andes. Peru hosts a biodiversity rarely seen within the limits of a single country, with a list of spectacular wildlife far beyond the well-known llamas and circling condors. On top of all that, Peru's friendly, multi-ethnic people are a cultural treasure on their own. The enchanting mix of dozens of distinct indigenous groups, mestizos and criollos, all with their own colourful traditions and food delicacies, is an encounter you won't easily forget.", Region = "Americas", Subregion = "South America")]
        PE = 176,

        [CustomCountry(Name = "Philippines", FullName = "Republic of the Philippines", Capital = "Manila", Description = "The Philippines, officially the Republic of the Philippines, is an archipelago of more than 7,100 islands in Southeast Asia.", Region = "Asia", Subregion = "South-Eastern Asia")]
        PH = 177,

        [CustomCountry(Name = "Pitcairn Islands", FullName = "Pitcairn Group of Islands", Capital = "Adamstown", Description = "The Pitcairn Islands are a loosely grouped handful of tiny islands in the remote South Pacific, farther from any continent than any other inhabited island. The islands are the last British overseas territory in the South Pacific and most isolated British dependency. The rugged main island was settled by the infamous mutineers of HMS Bounty and their Polynesian companions, and most of Pitcairn's mere four dozen current inhabitants are their descendants. They are one of the least-populated entities given an ISO country code (PN).", Region = "Oceania", Subregion = "Polynesia")]
        PN = 178,

        [CustomCountry(Name = "Poland", FullName = "Republic of Poland", Capital = "Warsaw", Description = "Poland has a rich and eventful history, and a strong basis for its bourgeoning tourism industry. As one of Europe's most underrated countries, it offers a fair share of countryside, vibrant urbanity, pristine beauty and a culture in connection to its thousand-year history.", Region = "Europe", Subregion = "Eastern Europe")]
        PL = 179,

        [CustomCountry(Name = "Portugal", FullName = "Portuguese Republic", Capital = "Lisbon", Description = "Portugal is a modern country with strong links to its past and people of a friendly and hospitable nature. It has become an acclaimed international tourist and vacation destination due to its many beautiful beaches and long warm summers, a rich gastronomy, historical and cultural heritage. Its fabulous golf courses, giant surf waves at Nazaré, and religious pilgrimage to Fátima are very popular with visitors. Surprisingly, in winter several ski resorts are open for business in the Serra da Estrela region.", Region = "Europe", Subregion = "Southern Europe")]
        PT = 180,

        [CustomCountry(Name = "Puerto Rico", FullName = "Commonwealth of Puerto Rico", Capital = "San Juan", Description = "Puerto Rico is a Caribbean island. Its white sandy beaches can compete with any in the world and vary from metropolitan cocktail heavens and bustling surfing hotspots to quiet island getaways. Easily accessible diving and snorkeling spots and the excellent bioluminescent bays offer great maritime experiences. Still, there's more to this tropical island than sunny beach life. The Spanish-American influences make for a fun melting pot of culture with an abundance of heritage to explore and some delightful food to enjoy.", Region = "Americas", Subregion = "Caribbean")]
        PR = 181,

        [CustomCountry(Name = "Qatar", FullName = "State of Qatar", Capital = "Doha", Description = "Qatar is a rich Arab state occupying a small peninsula extending into the Persian Gulf to the north of Saudi Arabia. Many come to the Middle East seeking the mystic, traditional life of the Bedouins, wandering the desert with their life's belongings on a camel's back. Although tradition is still an important part of the Qatari ethos, the country has well and truly moved into the twenty-first century with the piercing glass skyscrapers of Doha, a booming trade sector and a new-found place in international diplomacy. Qatar offers a unique blend of cultural authenticity and modern luxury, making it a major tourism hub in the region.", Region = "Asia", Subregion = "Western Asia")]
        QA = 182,

        [CustomCountry(Name = "Réunion", FullName = "Réunion Island", Capital = "Saint-Denis", Description = "Réunion is a French overseas department located in the midst of the Indian Ocean, east of the island of Madagascar and 200 kilometres (120 mi) to the south-west of Mauritius, in East Africa. This enchanting destination is blessed with a tropical climate and beautiful volcanic landscapes, with its appeal being as much due to its white sandy beaches as its mountain scenery. Réunion used to be known as the Isle de Bourbon and Isle Bonaparte.", Region = "Africa", Subregion = "Eastern Africa")]
        RE = 183,

        [CustomCountry(Name = "Romania", FullName = "Romania", Capital = "Bucharest", Description = "Romania is a country of great natural beauty and diversity and a rich cultural heritage, including a variety of ethnic, linguistic, and confessional groups. Romania enchants visitors with its scenic mountain landscapes and unspoiled rural areas, but also with its historic cities and busy capital. There has been significant development, especially since it joined the European Union in 2007. Still, it may surprise some of its visitors who are used to western Europe. It has six cultural and one natural UNESCO world heritage sites.", Region = "Europe", Subregion = "Eastern Europe")]
        RO = 184,

        [CustomCountry(Name = "Russia", FullName = "Russian Federation", Capital = "Moscow", Description = "Russia is the world's largest country, covering more than one-eighth of the Earth's inhabited land area. Russia boasts a rich history and culture, as well as a wealth of natural attractions for those willing to head off the beaten path. Many of Russia's attractions for visitors lie in the hard-to-reach stretches of the planet's most remote lands. The best known sights are in and around the nation's principal cities of Moscow and Saint Petersburg.", Region = "Europe", Subregion = "Eastern Europe")]
        RU = 185,

        [CustomCountry(Name = "Rwanda", FullName = "Republic of Rwanda", Capital = "Kigali", Description = "Rwanda is a relatively stable East African country, and easily accessible from Kenya and Uganda. It is known as the land of a thousand hills, but is also a country rich in flora and fauna and stunning natural beauty in its scenic rolling and breathtaking green savannah. The country hosts some rare species of animals like the silverback mountain gorillas as well as unique birds and insects in the tropical forest of Nyungwe. Rwanda is relatively easy, safe, and simple to travel around.", Region = "Africa", Subregion = "Eastern Africa")]
        RW = 186,

        [CustomCountry(Name = "Saint Barthélemy", FullName = "Collectivity of Saint Barthélemy", Capital = "Gustavia", Description = "Saint-Barthélemy is a French island in the Caribbean among the Leeward Islands. St Barts has long been considered a playground of the rich and famous and is known for its beautiful pristine beaches, gourmet dining in chic restaurants and high-end designer shopping. There is one small airport that can only accommodate small prop planes from St Martin and San Juan, and the harbour is too small to accommodate cruise ships. The fact that it is hard to get to is part of the island's appeal.", Region = "Americas", Subregion = "Caribbean")]
        BL = 187,

        [CustomCountry(Name = "Saint Helena, Ascension and Tristan da Cunha", FullName = "Saint Helena, Ascension and Tristan da Cunha", Capital = "Jamestown", Description = "Saint Helena, Ascension and Tristan da Cunha is a British overseas territory consisting of the islands of Saint Helena and Ascension, together with the Tristan da Cunha islands group. These are among the world's most isolated islands and separated from each other by many hundreds of miles.", Region = "Africa", Subregion = "Western Africa")]
        SH = 188,

        [CustomCountry(Name = "Saint Kitts and Nevis", FullName = "Federation of Saint Christopher and Nevis", Capital = "Basseterre", Description = "Saint Kitts and Nevis are a pair of tropical islands in the Caribbean, about one-third of the way from Puerto Rico to Trinidad and Tobago. What is really remarkable on Saint Kitts and Nevis is the natural aspect. Many tropical birds which one rarely finds elsewhere are present in great concentration in the nature and there are also the famous monkeys which, it is said, were introduced by the pirates. It is called \"The Mother Colony of the West Indies\".", Region = "Americas", Subregion = "Caribbean")]
        KN = 189,

        [CustomCountry(Name = "Saint Lucia", FullName = "Saint Lucia", Capital = "Castries", Description = "Saint Lucia is an island nation in the Caribbean. Saint Lucia is a popular destination due to its tropical weather, lush and mountainous scenery, numerous beaches, local accommodations, and range of resorts. St. Lucia has become a significant wedding destination.", Region = "Americas", Subregion = "Caribbean")]
        LC = 190,

        [CustomCountry(Name = "Saint Martin", FullName = "Saint Martin", Capital = "Marigot", Description = "Saint Martin is an island in the Caribbean that is split between the French collectivity of Saint-Martin and the Dutch territory of Sint Maarten. Beauty abounds on the island, with bluffs overlooking pretty harbors, sandy-cliffed beaches and tranquil rocky coves where fish provide the beauty.", Region = "Americas", Subregion = "Caribbean")]
        MF = 191,

        [CustomCountry(Name = "Saint Pierre and Miquelon", FullName = "Saint Pierre and Miquelon", Capital = "St. Pierre", Description = "Saint Pierre and Miquelon are a small group of islands in the North Atlantic Ocean, south of Newfoundland and Labrador. First settled by the French in the early 17th century, the islands are the sole remaining vestige of France's once vast North American empire, New France.", Region = "Americas", Subregion = "North America")]
        PM = 192,

        [CustomCountry(Name = "Saint Vincent and the Grenadines", FullName = "Saint Vincent and the Grenadines", Capital = "Kingstown", Description = "Saint Vincent and the Grenadines is an island nation in the Caribbean, north of Trinidad and Tobago.", Region = "Americas", Subregion = "Caribbean")]
        VC = 193,

        [CustomCountry(Name = "Samoa", FullName = "Independent State of Samoa", Capital = "Apia", Description = "Samoa is an island nation in the South Pacific Ocean, part of Polynesia. It is an archipelago of 10 islands with ancient cultures, dramatic landscapes, and a variety of activities to do, such as snorkelling in Samoa's vibrant coral gardens.", Region = "Oceania", Subregion = "Polynesia")]
        WS = 194,

        [CustomCountry(Name = "San Marino", FullName = "Republic of San Marino", Capital = "San Marino", Description = "San Marino, completely surrounded by Italy, is one of the world's smallest countries, and claims to be the world's oldest republic.", Region = "Europe", Subregion = "Southern Europe")]
        SM = 195,

        [CustomCountry(Name = "São Tomé and Príncipe", FullName = "Democratic Republic of São Tomé and Príncipe", Capital = "São Tomé", Description = "São Tomé and Príncipe consists of two main islands straddling the Equator off the Atlantic coast of Central Africa.", Region = "Africa", Subregion = "Middle Africa")]
        ST = 196,

        [CustomCountry(Name = "Saudi Arabia", FullName = "Kingdom of Saudi Arabia", Capital = "Riyadh", Description = "Saudi Arabia is the quintessential Arab kingdom. Vast deserts, scorching heat, immense oil wealth, camel races, glitzy shopping malls, traditional souq markets, you can find every Arabian cliche you can think of and then some here. A deeply conservative country that was entirely closed off to (non-pilgrimage) tourism for decades, the government did a drastic policy U-turn in 2019 and has been trying to open up the country to the world and shed the country's straight-laced image, with mixed success.", Region = "Asia", Subregion = "Western Asia")]
        SA = 197,

        [CustomCountry(Name = "Senegal", FullName = "Republic of Senegal", Capital = "Dakar", Description = "Senegal is a country in West Africa. Formerly a French colony, it is the westernmost country in the Old World.", Region = "Africa", Subregion = "Western Africa")]
        SN = 198,

        [CustomCountry(Name = "Serbia", FullName = "Republic of Serbia", Capital = "Belgrade", Description = "Serbia is a Balkan country in Southeastern Europe. It is at the crossroads of European history, and as such is a mix of cultures, ethnicities and religions. It lies on one of the major land routes from Central Europe to the Near East. It was the dominant component of Yugoslavia, and considered to be its natural successor. Despite having developed as a tourist destination much later than neighbouring Croatia, it is also a varied and beautiful nation, offering a mixed scenery: from the plains of Vojvodina that remind one of the scenes from Dr. Zhivago in winter, to many mountains, lakes, and national parks. During the summer tourists love spending their time in Belgrade, seen as one of the up-and-coming capitals of Europe. In winter, they are attracted to the ski resorts, one of the most popular being Kopaonik. There are also many spa resorts. Serbia has a soulfulness and verve, coupled a gusto for good living, that are rare to find, while its people are some of the most hospitable and welcoming.", Region = "Europe", Subregion = "Southern Europe")]
        RS = 199,

        [CustomCountry(Name = "Seychelles", FullName = "Republic of Seychelles", Capital = "Victoria", Description = "The Seychelles is an island nation in the Indian Ocean, northeast of Madagascar and east of Kenya. It consists of 115 islands, of which the largest are Mahe, Praslin, and La Digue. The capital and largest city is Victoria, located on the island of Mahe.", Region = "Africa", Subregion = "Eastern Africa")]
        SC = 200,

        [CustomCountry(Name = "Sierra Leone", FullName = "Republic of Sierra Leone", Capital = "Freetown", Description = "Sierra Leone is on the West Coast of Africa. The potential for tourism is vast, but largely unrealized, despite the end of the Civil War in 2002, and tour operators are looking closely at what the country has to offer. Sierra Leone is rich in natural resources. It has some of the best beaches in the world, a rich heritage, and some stunning scenery, but its greatest asset is its welcoming, friendly populace.", Region = "Africa", Subregion = "Western Africa")]
        SL = 201,

        [CustomCountry(Name = "Singapore", FullName = "Republic of Singapore", Capital = "Singapore", Description = "Singapore is a city-state in Southeast Asia. Modern Singapore was founded as a British trading colony in 1819, and since independence, it has become one of the world's most prosperous countries and boasts one of the world's busiest ports. Singaporean food is legendary, with bustling hawker centres and 24-hour coffee shops offering affordable food from all parts of Asia. Combining the skyscrapers and shopping malls of an affluent modern city with a medley of different Asian cultures and a tropical climate, good shopping and a vibrant nightlife scene, this Garden City makes a great stopover or springboard into the region.", Region = "Asia", Subregion = "South-Eastern Asia")]
        SG = 202,

        [CustomCountry(Name = "Sint Maarten", FullName = "Sint Maarten", Capital = "Philipsburg", Description = "Saint Martin is an island in the Caribbean that is split between the French collectivity of Saint-Martin and the Dutch territory of Sint Maarten. Beauty abounds on the island, with bluffs overlooking pretty harbors, sandy-cliffed beaches and tranquil rocky coves where fish provide the beauty.", Region = "Americas", Subregion = "Caribbean")]
        SX = 203,

        [CustomCountry(Name = "Slovakia", FullName = "Slovak Republic", Capital = "Bratislava", Description = "Slovakia or the Slovak Republic is a country in Central Europe. The main reasons to visit Slovakia are its natural beauty, vivid history and great opportunities for relaxation.", Region = "Europe", Subregion = "Eastern Europe")]
        SK = 204,

        [CustomCountry(Name = "Slovenia", FullName = "Republic of Slovenia", Capital = "Ljubljana", Description = "Slovenia is a country in central Europe that lies in the eastern Alps, at the northern end of the Adriatic Sea. It is sometimes considered to be a Balkan country. Despite its small size, Slovenia has a surprising variety of terrain, ranging from the beaches of the Mediterranean to the peaks of the Julian Alps and the rolling hills of the south. Slovenia is also home to some of the finest scenery in the \"New Europe\". The transition from socialism to the European common market economy has gone well and serves as a model for other nations on the same track to follow.", Region = "Europe", Subregion = "Southern Europe")]
        SI = 205,

        [CustomCountry(Name = "Solomon Islands", FullName = "Solomon Islands", Capital = "Honiara", Description = "The Solomon Islands are a South Pacific archipelago east of Papua New Guinea. They sit in the sea routes between the South Pacific Ocean, the Solomon Sea, and the Coral Sea. There are six major islands and over 900 smaller islands. The Solomons offer all the great attractions of Melanesia. Idyllic island scenery with perfect sandy beaches and splendid nature —in their rainforest, lagoons and waterfalls. For those who like to dive, underwater life is as stunning as that above. There's an abundance of wildlife to discover and amazing, colorful cultural traditions to see.", Region = "Oceania", Subregion = "Melanesia")]
        SB = 206,

        [CustomCountry(Name = "Somalia", FullName = "Federal Republic of Somalia", Capital = "Mogadishu", Description = "Somalia is a country on the Horn of Africa. Once the center of many powerful sultanates and an Italian colony, the country has been in a state of chaos and turmoil since the 1980s. The country suffers from a myriad of social problems such as warfare, terrorism, corruption, political instability, and general lawlessness, and it isn't exactly your typical family destination.", Region = "Africa", Subregion = "Eastern Africa")]
        SO = 207,

        [CustomCountry(Name = "South Africa", FullName = "Republic of South Africa", Capital = "Cape Town", Description = "South Africa is a superb destination rich in culture, fauna, flora and history. Africa's southernmost country is a large country with widely varying landscapes, 12 official languages, and an equally diverse population and is often known as the \"Rainbow Nation\".", Region = "Africa", Subregion = "Southern Africa")]
        ZA = 208,

        [CustomCountry(Name = "South Georgia", FullName = "South Georgia and the South Sandwich Islands", Capital = "King Edward Point", Description = "South Georgia Island is a sub-Antarctic island administered by the United Kingdom as part of South Georgia and the South Sandwich Islands. It lies 1390 km southeast of the Falkland Islands and 2150 km from South America, and is 170 km long by 35 km wide with a mountainous interior. Its bays and islets are home to vast numbers of birds and marine life, but there is no permanent human population, and South Georgia's remoteness makes it a rare destination for tourists.", Region = "Antarctic", Subregion = null)]
        GS = 209,

        [CustomCountry(Name = "South Sudan", FullName = "Republic of South Sudan", Capital = "Juba", Description = "South Sudan is a country in Central Africa. The world’s youngest country, it was a part of Sudan until it became an independent country on 9 July 2011.", Region = "Africa", Subregion = "Middle Africa")]
        SS = 210,

        [CustomCountry(Name = "Spain", FullName = "Kingdom of Spain", Capital = "Madrid", Description = "Spain is famous for its friendly inhabitants, relaxed lifestyle, its cuisine, vibrant nightlife, and world-famous folklore and festivities, and historically the core of the vast Spanish Empire. It has the second-largest number of UNESCO World Heritage Sites after Italy and the largest number of World Heritage Cities.", Region = "Europe", Subregion = "Southern Europe")]
        ES = 211,

        [CustomCountry(Name = "Sri Lanka", FullName = "Democratic Socialist Republic of Sri Lanka", Capital = "Colombo", Description = "Sri Lanka, formerly known as Ceylon, is in South Asia. In the Indian Ocean just south of India, Sri Lanka is an island known for its natural beauty. Sri Lanka has stunning beaches all along its coastline, great wildlife and biodiversity, tea plantations, orchards, temples, monuments, and a cultural heritage dating back several millennia. Its cultural landscape includes the Sinhala and the Tamil ethnic groups, with substantial Muslim and Christian communities.", Region = "Asia", Subregion = "Southern Asia")]
        LK = 212,

        [CustomCountry(Name = "Sudan", FullName = "Republic of the Sudan", Capital = "Khartoum", Description = "Sudan is a country in Northeast Africa and is Africa's third largest country in terms of area. Sudan was the continent's largest country up until the secession of South Sudan in 2011. Since the 1980s, Sudan has been in the news for all the wrong reasons. The country has had a particularly turbulent history since independence from the United Kingdom, and has suffered from decades of conflict and warfare. Under less dire circumstances, however, travelling to Sudan offers one the opportunity to explore a large, diverse nation whose history is believed to go all the way back to 8000 BCE and meet some very hospitable, jovial people.", Region = "Africa", Subregion = "Northern Africa")]
        SD = 213,

        [CustomCountry(Name = "Suriname", FullName = "Republic of Suriname", Capital = "Paramaribo", Description = "Suriname is a small republic on the northeast coast of South America. It prides itself on its thoroughly multi-ethnic culture, a colorful blend of indigenous Indian traditions and those of its former Dutch colonizers and the African, Javanese and Hindustani workers they once brought with them. It's a country with a fabulous and largely untouched Amazon inland, slowly discovering its chances as an ecotourism destination. International visitors are steadily following Dutch travelers who have long been drawn to this friendly, tropical country to explore its spectacular nature, captivating cultural heritage and meet its ever smiling people.", Region = "Americas", Subregion = "South America")]
        SR = 214,

        [CustomCountry(Name = "Svalbard and Jan Mayen", FullName = "Svalbard and Jan Mayen", Capital = "Longyearbyen", Description = "Svalbard is a group of islands located between the Arctic Ocean, Barents Sea, Greenland Sea, and the Norwegian Sea. The area is sometimes referred to as Spitsbergen, the main island with all the settlements. The islands are directly north of Norway, and have been under Norwegian rule since 1920. Svalbard's settlements are the second most northerly permanently-inhabited spots on the planet, after the Canadian military base at Alert.", Region = "Europe", Subregion = "Northern Europe")]
        SJ = 215,

        [CustomCountry(Name = "Sweden", FullName = "Kingdom of Sweden", Capital = "Stockholm", Description = "Sweden is the largest of the Nordic countries by area and population. Visitors can experience deep forests and many lakes, the heritage from the Viking Age and the 17th-century Swedish Empire, the glamour of the Nobel Prize, and the country's successful pop music scene. Sweden has 270,000 islands with many open to visit through the right to roam.", Region = "Europe", Subregion = "Northern Europe")]
        SE = 216,

        [CustomCountry(Name = "Switzerland", FullName = "Swiss Confederation", Capital = "Bern", Description = "Switzerland, is a mountainous country known globally for its neutrality, democracy, and almost-legendary affluence: Switzerland has one of the highest standards of living in the world, and prices to match.", Region = "Europe", Subregion = "Western Europe")]
        CH = 217,

        [CustomCountry(Name = "Syria", FullName = "Syrian Arab Republic", Capital = "Damascus", Description = "Syria is a country in the Middle East. Rich in history, the capital, Damascus, is the world's oldest continuously inhabited city, and the country has been the site of numerous empires.", Region = "Asia", Subregion = "Western Asia")]
        SY = 218,

        [CustomCountry(Name = "Taiwan", FullName = "Republic of China (Taiwan)", Capital = "Taipei", Description = "Taiwan is a self-governing group of islands off the coast of China. It is one of the most densely populated places in the world. Besides its crowded cities, Taiwan is also known for steep mountains and lush forests. Taiwan is home to a large number of impressive scenic sites, and Taipei is a center of culture, entertainment and leisure activities. The island is also a center of Chinese-language pop culture with a substantial entertainment industry.", Region = "Asia", Subregion = "Eastern Asia")]
        TW = 219,

        [CustomCountry(Name = "Tajikistan", FullName = "Republic of Tajikistan", Capital = "Dushanbe", Description = "Tajikistan is a landlocked country on the ancient Silk Road in Central Asia. The nation's majority culture is non-Turkic, unlike its neighbors to the north and west and east. Tajikistan is the poorest country out of the former Soviet states, owing to its remote geography and a devastating civil war that wracked the country from 1992 until 1997. But travelers here will find a land of stunning beauty, replete with soaring mountains, quaint pamirs, turquoise alpine lakes, Silk Road cities and ruins, and a charming and hospitable people. For those looking to experience a true adventurer's dream in the Roof of the World without the throngs of tourists in Nepal and Pakistan, Tajikistan is the place to be.", Region = "Asia", Subregion = "Central Asia")]
        TJ = 220,

        [CustomCountry(Name = "Tanzania", FullName = "United Republic of Tanzania", Capital = "Dodoma", Description = "Tanzania is the largest country in East Africa. From the picture-perfect coasts of Zanzibar to the world-renowned wildlife of the Serengeti, from the snowy slopes of Mount Kilimanjaro to the coral houses of Mikindani, Tanzania is the heart and soul of East Africa. Tanzania has several national parks and game reserves, where you can see some of the finest African flora and fauna.", Region = "Africa", Subregion = "Eastern Africa")]
        TZ = 221,

        [CustomCountry(Name = "Thailand", FullName = "Kingdom of Thailand", Capital = "Bangkok", Description = "Thailand is the most visited country in Southeast Asia, and for good reason. You can find thick jungle as green as can be, crystal blue waters that feel more like a warm bath than a swim in the ocean, and food that can curl your nose hairs while tap dancing across your taste buds. Exotic, yet safe; cheap, yet equipped with every modern amenity you need, there is something for every interest and every price bracket, from beachfront backpacker hostels to some of the best luxury hotels in the world.", Region = "Asia", Subregion = "South-Eastern Asia")]
        TH = 222,

        [CustomCountry(Name = "Timor-Leste", FullName = "Democratic Republic of Timor-Leste", Capital = "Dili", Description = "The Democratic Republic of Timor-Leste, commonly known as Timor-Leste or East Timor, is one of the world's newest countries: after a long struggle, it gained independence from Indonesia in 2002 and is now an off-the-beaten-path destination for diving and adventure.", Region = "Asia", Subregion = "South-Eastern Asia")]
        TL = 223,

        [CustomCountry(Name = "Togo", FullName = "Togolese Republic", Capital = "Lomé", Description = "Togo is a narrow country in West Africa, sandwiched between Ghana on the west and Benin on the east. It is a charming country, mostly due to its charming people as there are not many tourist attractions.", Region = "Africa", Subregion = "Western Africa")]
        TG = 224,

        [CustomCountry(Name = "Tokelau", FullName = "Tokelau", Capital = "Atafu", Description = "Tokelau is a group of three atolls in Polynesia, north of Samoa, about halfway between New Zealand proper and Hawaii.", Region = "Oceania", Subregion = "Polynesia")]
        TK = 225,

        [CustomCountry(Name = "Tonga", FullName = "Kingdom of Tonga", Capital = "Nukuʻalofa", Description = "Tonga, the \"Friendly Islands\", is an archipelago in the South Pacific Ocean, consisting of 169 islands, of which 36 are inhabited. The tourist industry is relatively undeveloped. Cruise ships often stop in Vavaʻu, which has a reputation for its whale watching, game fishing, surfing, and beaches.", Region = "Oceania", Subregion = "Polynesia")]
        TO = 226,

        [CustomCountry(Name = "Trinidad and Tobago", FullName = "Republic of Trinidad and Tobago", Capital = "Port of Spain", Description = "Trinidad and Tobago (TT) is a nation consisting primarily of two Caribbean islands, Trinidad and Tobago, just off the northeastern coast of Venezuela. The country is the most industrialized and one of the most prosperous in the Caribbean. Overall, tourism is not a major industry, leaving the islands replete with natural unspoiled beauty not found in most other Caribbean countries.", Region = "Americas", Subregion = "Caribbean")]
        TT = 227,

        [CustomCountry(Name = "Tunisia", FullName = "Republic of Tunisia", Capital = "Tunis", Description = "The Republic of Tunisia, is a country in North Africa bordering the Mediterranean Sea. Tourist infrastructure is well developed, and there are several ways to enjoy the loveliness of Tunisia, including spending time on the gorgeous Mediterranean beaches, viewing its ancient ruins, living its thriving desert culture, or sampling its delicious cuisine.", Region = "Africa", Subregion = "Northern Africa")]
        TN = 228,

        [CustomCountry(Name = "Türkiye", FullName = "Republic of Türkiye", Capital = "Ankara", Description = "Turkey, officially the Republic of Türkiye, is a bi-continental country: an oft-repeated cliché about Turkey is that it is the bridge between Europe and Asia. This is true not only geographically, but also culturally, and many Turks value their European and Asian identities equally. Therefore, Turkey is the ultimate \"exotic — but with a twist\" destination for many: plenty of travelers to the country will find a charming novelty in every corner, yet at the same time, will have a feel of comforting familiarity, regardless of which direction or how far they are arriving from. Add the Turks' legendary warmth towards the visitors to the mix, and you get the idea.", Region = "Asia", Subregion = "Western Asia")]
        TR = 229,

        [CustomCountry(Name = "Turkmenistan", FullName = "Turkmenistan", Capital = "Ashgabat", Description = "Turkmenistan is one of the most isolated countries in the world and has dubbed itself as the \"motherland of neutrality\". Formerly a part of the Soviet Union, it is situated in Central Asia and is surrounded by Kazakhstan, Uzbekistan, Afghanistan, and Iran. The country has been a thoroughfare for several empires and cultures; many of Turkmenistan's cities were main points of trade on the Silk Road, linking Eastern and Western civilizations. Three of its cities are UNESCO World Heritage Sites.", Region = "Asia", Subregion = "Central Asia")]
        TM = 230,

        [CustomCountry(Name = "Turks and Caicos Islands", FullName = "Turks and Caicos Islands", Capital = "Cockburn Town", Description = "The Turks and Caicos Islands are only about 60 km long, and consist of over 40 islands and cays. These islands have fabulous beaches throughout; in particular, Grace Bay. There also are a variety of fun, non-beach things that there are to do. You can scuba dive, snorkel, sail, boat, parasail, fish, go on tours, go to spas and salons, golf, shop, ride ponies and gamble. Each island has its own activities as well.", Region = "Americas", Subregion = "Caribbean")]
        TC = 231,

        [CustomCountry(Name = "Tuvalu", FullName = "Tuvalu", Capital = "Funafuti", Description = "Tuvalu is a group of low-lying islands and atolls in the South Pacific that form the fourth smallest country in the world. It is one of the most isolated and remote independent countries in the world. In this delightful Pacific destination, your time is well spent in the shade of a palm trees on one of the pretty beaches. Traditional local culture remains very much alive, making the people of Tuvalu one of the nation's best assets. Traditional dancing is performed on special occasions, and the local \"maneapa\" is your best chances of experiencing one. Tranquil in its beauty, Tuvalu offers a laid-back tropical atmosphere.", Region = "Oceania", Subregion = "Polynesia")]
        TV = 232,

        [CustomCountry(Name = "Uganda", FullName = "Republic of Uganda", Capital = "Kampala", Description = "Uganda was Nicknamed the \"Pearl of Africa\" by Winston Churchill. It is home to one of the most diverse and concentrated ranges of African fauna including the highly endangered mountain gorilla and the endangered common chimpanzee.", Region = "Africa", Subregion = "Eastern Africa")]
        UG = 233,

        [CustomCountry(Name = "Ukraine", FullName = "Ukraine", Capital = "Kyiv", Description = "Ukraine is a country in Eastern Europe, the largest country entirely within Europe, with a very rich culture and history.", Region = "Europe", Subregion = "Eastern Europe")]
        UA = 234,

        [CustomCountry(Name = "United Arab Emirates", FullName = "United Arab Emirates", Capital = "Abu Dhabi", Description = "The United Arab Emirates or simply the Emirates is a country rich in history and culture at the entrance to the Persian Gulf. Boasting attractions ranging from the glittering and cosmopolitan cities of Dubai and Abu Dhabi, to the vast and unforgiving desert landscapes of the Empty Quarter, it makes an easy starting point for travels in the Middle East.", Region = "Asia", Subregion = "Western Asia")]
        AE = 235,

        [CustomCountry(Name = "United Kingdom", FullName = "United Kingdom of Great Britain and Northern Ireland", Capital = "London", Description = "The United Kingdom of Great Britain and Northern Ireland is a constitutional monarchy comprising most of the British Isles. It is a union of four constituent countries: England, Northern Ireland, Scotland and Wales, each of which has something unique and exciting for visitors.", Region = "Europe", Subregion = "Northern Europe")]
        GB = 236,

        [CustomCountry(Name = "United States", FullName = "United States of America", Capital = "Washington, D.C.", Description = "The United States of America spans a continent and numerous islands: its diverse geography comprises vast uninhabited areas of natural beauty punctuated by cities ringed by sprawling suburbs. Its wide array of tourist destinations includes the skyscrapers of Manhattan and Chicago, the natural wonders of Yellowstone and Alaska, the canyonlands of the Southwest, the towering volcanoes and rugged coastlines of the Pacific Northwest, and the warm, sunny beaches of Florida, Hawaii, and Southern California.", Region = "Americas", Subregion = "North America")]
        US = 237,

        [CustomCountry(Name = "United States Minor Outlying Islands", FullName = "United States Minor Outlying Islands", Capital = "Wake Island", Description = "The United States Minor Outlying Islands are a group of small, mostly uninhabited atolls and islands scattered across the Pacific Ocean and the Caribbean. For adventurous travelers, these remote locations offer pristine marine environments, rich birdlife, and excellent opportunities for snorkeling, diving, and wildlife observation. There is no tourist infrastructure, and access is often restricted or requires permits; visits are best suited to scientific missions, experienced sailors, or nature enthusiasts seeking solitude and untouched seascapes.", Region = "Americas", Subregion = "North America")]
        UM = 238,

